        "_id": "4Yz6WfgGNEnYqjugf",
        "title": "Blonde car accident",
        "body": "One day, while a blonde was out driving her car, she ran into a truck. <br><br>The truck&apos;s driver made her pull over into a parking lot and get out of the car. <br><br>He took a piece of chalk and drew a circle on the pavement. <br><br>He told her to stand in the middle and not leave the circle. <br><br>Furious, he went over to her car and slashed the tires. <br><br>The blonde started laughing. <br><br>This made the man angrier so he smashed her windshield. <br><br>This time the blonde laughed even harder. <br><br>Livid, the man broke all her windows and keyed her car. <br><br>The blonde is now laughing hysterically, so the truck driver asks her what&apos;s so funny. <br><br>The blonde giggles and replies, &#x201C;When you weren&apos;t looking, I stepped out of the circle three times!&#x201D;",
