        "_id": "4rjivkejhvdbjro42",
        "title": "Letter from daughter to parents",
        "body": "Letter from Daughter to Parents        Dear Mother and Dad: It has now been three months since I left for college. <br><br>I have been remissin writing this and I am very sorry for my thoughtlessness in not having written before. <br><br>I will bring you up to date now, but before you read on, please sit down. <br><br>YOU ARE NOT TO READ ANY FURTHER UNLESS YOU ARE SITTING DOWN. <br><br>OKAY! <br><br>Well then, I am getting along pretty well now. <br><br>The skull  fracture and the concussion I got when I jumped out of the window of my dormitory when itcaught fire shortly after my arrival are pretty well healed now. <br><br>I only get those sick headaches once a day. <br><br>Fortunately the fire in the dormitory and my jump were witnessed by an attendantat the gas station near the dorm, and he was the one who called the firedepartment and the ambulance. <br><br>He also visited me at the hospital and sinceI had nowhere to live, because of the burned out dormitory, he was kind enough to invite me to share his apartment with him. <br><br>It&apos;s really a basement room, but it&apos;s kind of cute. <br><br>He is a very fine boy and we have fallen deeply inlove and are planning to be married. <br><br>We haven&apos;t set the exact date yet, butit will be before my pregnancy begins to show. <br><br>Yes Mother and Dad, I am pregnant. <br><br>I know how much you are looking forwardto being grr andparents and I know you will welcome the baby and give it the love, devotion and tender care you gave me when I was a child. <br><br>The reasonfor the delay in our marriage is that my boyfriend has some minor infectionwhich prevents us from passing our pre-marital blood tests and I carelesslycaught it from him. <br><br>This will soon clear up with the penicillin injectionsI am taking daily. <br><br>I know you will welcome him into our family with open arms. <br><br>He is kind andalthough not well educated, he is ambitious. <br><br>Although he is of a differentrace and religion than ours, I know your oft expressed tolerance will notpermit you to be bothered by the fact that his skin color is some what darkerthan ours. <br><br>I am sure you will love him as I do. <br><br>His family background isgood too, for I am told that his father is an important gun-bearer in the village in Africa from which he came. <br><br>Now that I have brought you up to date, I want to tell you that there wasno dormitory fire, I did not have a concussion or a skull fracture. <br><br>I wasnot in the hospital,  I am not pregnant,  I am  not engaged. <br><br>I do not have syphillis and there is no man (of any color) in my life. <br><br>However, I am gettinga &apos;D&apos; in History and an &apos;F&apos; in Science and I wanted you to see those marksin the proper perspective. <br><br>Yours-        Your Loving Daughter",
        "tags": [
            "Jokes",
            "School Jokes"
        ],
