        "_id": "5AYPTETjrnBXd9Nwg",
        "title": "I'm glad i'm a man",
        "body": "I&apos;M GLAD I&apos;M A MAN I&apos;m glad I&apos;m a man, you better believe. <br><br>I don&apos;t live off of yogurt, diet coke, or cottage cheese. <br><br>I don&apos;t bitch to my girlfriends about the size of my breasts. <br><br>I can get where I want to<br><br> - north, south, east or west. <br><br>I don&apos;t get wasted after only 2 beers, And when I do drink I don&apos;t end up in tears. <br><br>I won&apos;t spend hours deciding what to wear. <br><br>I spend 5 minutes max fixing my hair. <br><br>And I don&apos;t go around checking my reflection in everything shiny from every direction. <br><br>I don&apos;t whine in public and make us leave early, And when you ask why get all bitter and surly. <br><br>I&apos;m glad I&apos;m a man, I&apos;m so glad I could sing. <br><br>I don&apos;t have to sit around waiting for that ring. <br><br>I don&apos;t gossip about friends or stab them in the back. <br><br>I don&apos;t carry our differences into the sack. <br><br>I&apos;ll never go psycho and threaten to kill you Or think every guy out there&apos;s trying to steal you. <br><br>I&apos;m rational, reasonable, and logical too. <br><br>I know what the time is and I know what to do. <br><br>And I honestly think its a privilege for me to have these two balls and stand when I pee. <br><br>I live to watch sports and play all sorts of ball. <br><br>It&apos;s more fun than dealing with women after all. <br><br>I won&apos;t cry if you say it&apos;s not going to work. <br><br>I won&apos;t remain bitter and call you a jerk. <br><br>Feel free to use me for immediate pleasure. <br><br>I won&apos;t assume it&apos;s permanent by any measure. <br><br>Yes, I&apos;m so very glad I&apos;m a man, you see. <br><br>I&apos;m glad I&apos;m not capable of child delivery. <br><br>I don&apos;t get all bitchy every 28 days. <br><br>I&apos;m glad that my gender gets me a much bigger raise. <br><br>I&apos;m a man by chance and I&apos;m thankful it&apos;s true. <br><br>I&apos;m so glad I&apos;m a man and not a woman like you! <br><br>",
