        "title": "Soft and hard",
        "body": "A man is in a hotel lobby. <br><br>He wants to ask the clerk a question. <br><br>As he turns to go to the front desk, he accidentally bumps into a woman beside him and as he does, his elbow goes into her breast. <br><br> They are both quite startled. <br><br>The man turns to her and says, &#x201C;Ma&apos;am, if your heart is as soft as your breast, I know you&apos;ll forgive me. &#x201D; She replies, &#x201C;If your penis is as hard as your elbow, I&apos;m in room 436. &#x201D;",
