        "_id": "6WHeKy7Cv8JMPWzZT",
        "title": "Polish guy at the beach",
        "body": "A Polish guy is walking along the beach in France. <br><br>There are many beautiful women lying in the sun, and he really wants to meet one. <br><br>But try as he might, the women don&apos;t seem to be at all interested. <br><br>Finally, as a last resort, he walks up to a French guy lying on the beach who is surrounded by adoring women. &#x201D; Excuse me,&#x201D; he says, taking the guy aside, &#x201C;but I&apos;ve been trying to meet one of those women for about an hour now, and I just can&apos;t seem to get anywhere with them. <br><br>You&apos;re French. <br><br>You know these women. <br><br>What do they want?&#x201D;<br><br>&#x201C;Maybe I can help a leetle beet,&#x201D; says the Frenchman. <br><br>&#x201C;What you do ees you go to zee store. <br><br>You buy a leetle bikini sweeming suit. <br><br>You walk up and down zee beach. <br><br>You meet girl very qweekly zees way.&#x201D; <br><br>&#x201C;Wow! <br><br> Thanks!&#x201D; says the Polish guy, and off he goes to the store. <br><br>He buys a skimpy red bathing suit, puts it on, and goes back to the beach. <br><br>He parades up and down the beach but still has no luck with the ladies. <br><br>So he goes back to the Frenchman. <br><br>&#x201C;I&apos;m sorry to bother you again,&#x201D; he says, &#x201C;but I went to the store, I got a swimsuit, and I still haven&apos;t been able to meet a girl.&#x201D; <br><br>&#x201C;Okay,&#x201D; says the Frenchman, &#x201C;I tell you what you do. <br><br>You go to zee store. <br><br>You buy potato. <br><br>You put potato in sweeming suit and walk up and down zee beach. <br><br>You will meet girl very, very qweekly zees way.&#x201D;<br><br>&#x201C;Thanks!&#x201D; says the guy, and runs off to the store. He buys the potato, puts it in the swimsuit, and marches up and down the beach. Up and down, up and down he walks, but the women will hardly even look at him. After half an hour he can&apos;t take it anymore and goes back to the Frenchman. &#x201D; Look,&#x201D; he says, &#x201C;I got the suit, I put the potato in it, and I walked up and down the beach and still nothing!  What more can I do?&#x201D;<br><br>&#x201C;Well,&#x201D; says the Frenchman, &#x201C;maybe I can help you a leetle beet. Why don&apos;t you try moving zee potato to the FRONT of zee sweeming suit?&#x201D;",
