        "title": "Building a bridge",
        "body": "A man walking along a beach finds a lamp, picks it up, rubs it and this genie pops out. <br><br>The genie says, &#x201C;For releasing me I shall grant you one wish!&#x201D; The man thinks for a minute, and says, &#x201C;I want you to build a bridge to Hawaii. <br><br>I&apos;m scared of flying and tend to get seasick.&#x201D; The genie replies, &#x201C;My good lad, do you realize how much it will take to do that?  First of all, it will cost millions just to hire the workers. Not to mention all the materials it will take. In addition, there would need to be countless rest stops and gas stations and it would interfere with shipping lanes. I&apos;m sorry, but it just can&apos;t be done. Please choose another wish!&#x201D; The man thinks for a minute, and says, &#x201C;I want to be able to understand women.&#x201D; The genie pauses for a moment and says -&#x201D; So, this bridge you want... two lanes or four?&#x201D;",
