        "title": "Lawyers give irrelevant information",
        "body": "Two women are on a transcontinental balloon voyage. <br><br>Their craft is engulfed in fog, their compass gone awry. <br><br>Afraid of landing in the ocean, they drift for days. <br><br>Suddenly, the clouds part to show a sunlit meadow below. <br><br>As they descend, they see a man walking his dog. <br><br>One of the flyers yells to the figure far below, &#x201C;Where are we?&#x201D; The man yells back, &#x201C;About a half mile from town. &#x201D; Once again, the balloonists are engulfed in the mist. One flyer says to the other, &#x201C;He must have been a lawyer.&#x201D; The other says, &#x201C;A lawyer!  How do you know that?&#x201D; The first says, &#x201C;That? s easy. The information he gave us was accurate, concise, and entirely irrelevant. &#x201D;",
