        "title": "You've got mail",
        "body": "A blonde quickly went out to her mail box, looked in it, closed the door of the box, and went back in the house. <br><br>A few minutes later she repeated this process by checking her mail again. <br><br>She did this five more times, and her neighbor that was watching her commented: &#x201C;You must be expecting a very important letter today the way you keep looking into that mail box.&#x201D; The blonde answered, &#x201C;No, I am working on my computer, and it keeps telling me that I have mail. &#x201D;",
