        "_id": "9NANxCNMry7oPyJcJ",
        "title": "Nun on the bus",
        "body": "A guy is riding the bus when at a stop, the most beautiful woman he has ever seen gets on. <br><br>The only problem is that she is a nun. <br><br>He decides to approach her anyway. &#x201D; Sister, you are the most beautiful woman I&apos;ve ever seen and I must have sex with you.&#x201D; <br><br>he says. <br><br>&#x201C;I&apos;m sorry but I&apos;ve given my body to God. &#x201D; she replies and then leaves. <br><br>Suddenly the bus driver turns around to the guy and says &#x201C;I know a way you can get her in the sack.&#x201D; <br><br>The bus driver tells the guy about how the nun goes to confessional everyday at 3 in the afternoon. The bus driver tells the guy his plan and the guy leaves happy knowing he&apos;s going to get some. The next day at 3 the guy is in the booth dressed as a priest. When the nun approaches in the darkness he says &#x201C;Sister, God has told me I must have sex with you. &#x201D; She replies &#x201C;Well if God has said it, we must do it. However because of my strong commitment to God I will only take it up the ass.&#x201D; The guy figures this isn&apos;t a problem and proceeds to have the best sex ever. After it is over he whips off his outfit and says, &#x201C;Surprise I&apos;m the guy on the bus. &#x201C;With that the nun turns around and says, &#x201C;Surprise I&apos;m the bus driver. &#x201D;",
