        "_id": "9aC6uWyRpnPn4xr2T",
        "title": "The irish wedding",
        "body": "A wedding occurred just outside Cavan in Irel and. <br><br>To keep tradition going, everyone gets extremely drunk and the bride&apos;s and groom&apos;s families have a storming row and begin wrecking the reception room and generally kicking the shit out of each other. <br><br>The police get called in to break up the fight. <br><br>The following week, all members of both families appear in court. <br><br>The fight continues in the courtroom until the judge finally brings calm with the use of his gavel, shouting, &apos;Silence in court! &apos;The courtroom goes silent and Paddy, the best man, stands up and says, &apos;Judge, I was the best man at the wedding and I think I should explain what happened. &apos;The judge agrees and asks Paddy to take the stand. <br><br>Paddy begins his explanation by telling the court that it is traditional in a Cavan wedding that the best man gets the first dance with the bride. <br><br>The judge says, &apos;OK. &apos;&apos;Well, &apos; said Paddy, &apos;after I had finished the first dance, the music kept going, so I continued dancing to the second song, and after that the music kept going and I was dancing to the third song, when all of a sudden the groom leapt over the table, ran towards us and gave the bride an unmerciful kick right between her legs. &apos;Shocked, the judge instantly responded, &apos;God, that must have hurt! &apos;&apos;Hurt? &apos; Paddy replies. &apos;He broke three of my fingers! &apos;",
