        "_id": "9p5r7WQAB69sQesiT",
        "title": "John and david were both patients in a mental hospital...",
        "body": "John and David were both patients in a Mental hospital. <br><br>One day, John suddenly dived into the deep end of the swimming pool. <br><br>David jumped inand saved him, and the medical director came to know of his heroic act. <br><br>He immediately order David to be discharged from the mental hospital as he is OK. <br><br>Doctor: We have good news and bad news for you, David. <br><br>The good news is that we are going to discharge you because you have regained your senses, since you are able to jump in and save another patient you are now a normal person. <br><br>The bad news is that, the patient Mr. John, whom you have saved, hung himself in the toilet, and died. <br><br>David: Doctor, he didn&apos;t hang himself. <br><br>I hung him there to dry",
