        "_id": "A9GEGreXkRZWQaEiF",
        "title": "Communication problem",
        "body": "There was this Asian lady married to an American gentleman and they lived in Honolulu. <br><br>The poor lady was not very proficient in English, but managed to communicate with her husband. <br><br>The real problem arose whenever she had to shop for groceries. <br><br>One day, she went to the butcher and wanted to buy pork legs. <br><br>She didn&apos;t know how to put forward her request, and in desperation, lifted up her skirt to show her thighs. <br><br> The butcher got the message and the lady went home with pork legs. <br><br>The next day, she needed to get chicken breasts. <br><br>Again, she didn&apos;t know how to say, and so she unbuttoned her blouse to show the butcher her breast. <br><br>The lady got what she wanted. <br><br>The 3rd day, the poor lady needed to buy sausages. <br><br>Unable to find a wayto communicate this, she brought her husband to the store... What were you thinking? <br><br> Helloooooooooo, her husband speaks English!! <br><br>",
