        "title": "From us...",
        "body": "The teacher walks in and finds an apple on her desk with the letters &#x201C;ILU&#x201D; written on it. <br><br>The teacher asks who left it. <br><br>A little white girl raises her hand. <br><br>Well sweetie, what does &#x201C;ILU&#x201D; mean? <br><br> The little girl replies, &#x201C;I love you.&#x201D; <br><br>The teacher says, &#x201C;Isn&apos;t that sweet, &#x201D; and continues with class. <br><br>The next day the teacher finds a banana on her desk with the letters &#x201C;YAS&#x201D; written on it. The teacher asks who left and what does it mean. A little white boy raises his hand and says, &#x201C;It means, You are special.&#x201D;<br><br>&#x201C;Thank you sweetheart&#x201D; , the teacher says. The following day, the teacher walks in to find a watermelon with the letters &#x201C;FUCK&#x201D; written on it. The enraged teacher asks who left it and if they know what that means. A little black girl raises her hand and cheerfully says, &#x201C;Yes maam, I left it. It means, from us colored kids!&#x201D; . <br><br>",
