        "body": "Two priests and a rabbi were discussing what portion of the weekly collection they kept for themselves. <br><br>The first priestexplained that he drew a circle on the ground, stepped a fewpaces back and pitched the money towards the circle. <br><br>Whatl anded in the circle he kept and what landed outside the circle god kept. <br><br>The second priest claimed that his method was almost the same, except that what landed outside the circle went to the priest and the money that landed inside the circle god kept. <br><br>The rabbi said, &#x201C;I&apos;ve got you both beat. I throw the moneyinto the air and what god wants, god takes. &#x201D;",
