        "_id": "BHJHBp75EMHmaerWX",
        "title": "The approach of winter",
        "body": "Dec. 8.  5:00 p.m. <br><br><br>\r\n- It&apos;s starting to snow, the first of     the season, and the wife and I took our buttered rum and sat     by the window watching the soft flakes drift down, clinging     to the trees and covering the ground. <br><br>It was so beautiful. <br><br>Dec. 9.br&gt;<br> - We awoke to a big beautiful blanket of crystal     white snow covering the landscape. <br><br>What a fantastic sight. <br><br>    Every tree and shrub covered with a beautiful white mantel. <br><br>    I shoveled snow for the first time in years, and I loved it. <br><br>    I did both our driveway and our sidewalks. <br><br>Later the     snowplow came along and covered up our driveway with     compacted snow from the street. <br><br>He smiled and I waved back. <br><br>    I shoveled it again. <br><br>Dec. 12.br&gt;<br> - The sun has melted most of our lovely snow. <br><br>Oh     well, I&apos;m sure we&apos;ll get a little more before this lovely     winter is over. <br><br>Dec. 14.br&gt;<br> - It snowed 8 inches last night and the temperature     dropped to about 0 degrees. <br><br>Shoveled the sidewalk and     driveway again. <br><br>Shortly the snowplow came by and did his     trick again. <br><br>Dec. 15.br&gt;<br> - Sold our car and bought a 4x4 Blazer so we could     get through the snow. <br><br>Bought snow tires for the truck. <br><br>Dec. 18.br&gt;<br> - Fell on my Ass on the ice in the driveway. <br><br>$23.00     to the chiropractor, but nothing was broken, thank God! <br><br> The     damn sky is getting dark again. <br><br>Dec. 19.br&gt;<br> - Still cold (-10 this a.m.) Icy roads making for     very tough driving. <br><br>Slid into a guard rail with my wife&apos;s     car. <br><br>Probably a $100.00 damage or so. <br><br>She&apos;s pissed-off. <br><br>Dec. 20.br&gt;<br> - Had another 14 inches of the white shit last     night. <br><br>More shoveling in store for me today. <br><br>That damned     snowplow came by twice. <br><br>Dec. 22.br&gt;<br> - We are assured of a white Christmas because     another 7 inches of that white shit fell today and with this     freezing weather it won&apos;t melt till August! <br><br> Got all dressed     up to go out and shovel that shit again. <br><br>(Boots, snowsuit,     jacket, scarf, earmuffs, gloves, etc... ) then got the urge to     pee. <br><br>Dec 24<br><br> - If I ever catch the son-of-a-bitch that drives     that snowplow, I&apos;ll drag him through the snow by his balls. <br><br>    I think he hides around the corner and waits for me to     finish shovelling and then comes down the street 100 miles     an hour and throws that white shit everywhere. <br><br>Dec. 25.br&gt;<br> - MERRY CHRISTMAS... they predict 12 more inches of     the fucking white stuff tonight. <br><br>Does anyone know how many     damned shovels full of snow 12 inches is? <br><br> To hell with     Santa, he doesn&apos;t have to shovel that white shit. <br><br>The     snowplow driver came by asking for a donation. <br><br>I hit him     with my ice axe. <br><br>Dec. 28.br&gt;<br> - We got 11 more inches. <br><br>I must be going snowblind     or have a severe case of depression. <br><br>Dec. 29.br&gt;<br> - The toilet froze and the roof is starting to     cave-in. <br><br>If you go outside, don&apos;t eat the brown snow. <br><br>Dec. 30.br&gt;<br> - I torched the damned house ... moving back to     Florida! <br><br>",
        "tags": [
            "Jokes",
            "Miscellaneous Jokes"
        ],
