        "title": "Indicator",
        "body": "A businessman entered a tavern, sat down at the bar, and ordered a doublescotch on the rocks. <br><br>After he finished the drink, he peeked inside hisshirt pocket, then he ordered another double scotch. <br><br>After he finished that one, he again peeked inside his shirt pocket andordered another double scotch. <br><br>Finally, the bartender said, &#x201C;Look, buddy, I&apos;ll bring you drinks all nightlong. But you gotta tell me why you look inside your shirt pocket before you order another.&#x201D; The customer replied, &#x201C;I&apos;m looking at a photo of my wife. When she startsto look good, then I know it&apos;s time to go home. &#x201D;",
