        "_id": "BcyycXRLZxb98PRhk",
        "title": "A different father",
        "body": "A very elderly couple is having an elegant dinner to celebrate their 75th wedding anniversary. <br><br>The old man leans forward and says softly to his wife &#x201C;Dear, there is something that I must ask you. <br><br>It has always bothered me that our tenth child never quite looked like the rest of our children. NowI want to assure you that these 75 years have been the most wonderful experience I could have ever hoped for, and your answer cannot take all that away. But, .. I must know, did he have a different father?&#x201D; ... The wife drops her head, unable to look her husband in the eye, she paused for moment and then confessed. &#x201D; Yes. Yes he did. &#x201D;... The old man is very shaken, the reality of what his wife was admitting hit him harder than he had expected. With a tear in his eye he asks &#x201C;Who?  Who was he?  Who was the father?&#x201D; ... Again the old woman drops her head, saying nothing at first as she tried to muster the courage to tell the truth to her husband. Then, finally, she says &#x201C;You&#x201D; . <br><br>",
