        "_id": "CgkMDyEnysuApQysM",
        "title": "Fatherly feelings",
        "body": "One night a wife found her husband standing over their baby&apos;s crib. <br><br>Silently she watched him. <br><br>As he stood looking down at the sleeping infant, she saw on his face a mixture of emotions: disbelief, doubt, delight, amazement, enchantment, skepticism. <br><br>Touched by this unusual display and the deep emotions it aroused, with eyes glistening she slipped her arm around her husband. &#x201D; A penny for your thoughts,&#x201D; she said. <br><br>&#x201C;It&apos;s amazing!&#x201D; he replied. <br><br>&#x201C;I just can&apos;t see how anybody can make a crib like that for only $46. <br>\r\n50. &#x201D;",
