        "_id": "CkDEHEbPAAe5XrmdA",
        "title": "Mother teresa's constipation",
        "body": "Two nuns walk into a liquor store and one asked the clerk for the biggest bottle of Irish whisky he had. <br><br>The clerk replied &#x201C;Heck no sister, you nuns and aren&apos;t supposed to drink that stuff!&#x201D; The nun said &#x201C;Well my son it is not for us you see, it is for Mother Teresa, &#x201D; then the nun whispers &#x201C;She has the constipation.&#x201D; The clerk said &#x201C;Oh, in that case, it&apos;s on the house. Here&apos;s the biggest jug we have.&#x201D; The nuns thank him, bless him, and leave. A few hours later, as the clerk is leaving, he sees the same two sisters in the parking lot, rolling around and drinking the Irish whiskey. Appalled he goes over to them and says &#x201C;You ladies lied to me!  You told me it was for Mother Teresa for her constipation!&#x201D; One of the nuns takes another swig, looks up at him and says &#x201C;You wanna know something buddy?  She sure will shit when she sees us!&#x201D;",
