        "_id": "CtiZhAGeFHW7rJPXd",
        "title": "Debate about the box",
        "body": "An engineer, a physicist, and a mathematician are trying to set up a fenced-in area for some sheep, but they have a limited amount of building material. <br><br>The engineer gets up first and makes a square fence with the material, reasoning that it&apos;s a pretty good working solution. <br><br>&#x201C;No no,&#x201D; says the physicist, &#x201C;there&apos;s a better way. &#x201D; He takes the fence and makes a circular pen, showing how it encompasses the maximum possible space with the given material. Then the mathematician speaks up: &#x201C;No, no, there&apos;s an even better way. &#x201D; To the others&apos; amusement he proceeds to construct a little tiny fence around himself, then declares: &#x201C;I define my self to be on the outside. &#x201D;",
