        "_id": "DBsEGBb87pRohrEfx",
        "title": "A cowboy along with his horse and dog are captured late one...",
        "body": "A cowboy along with his horse and dog are captured late oneafternoon by hostile Indians. <br><br>This presents no problem for thehorse as the Indians can always use another pony. <br><br>The dog&apos;sfate is some what tenuous but it is certain that the cowboy willbe burned at the stake the following sunrise. <br><br>That evening theIndian chief tells the cowboy that he can have one last wish, within reason, before meeting his ultimate fate the the following morning. <br><br>The cowboy tells the chief that his lastrequest is to see his faithful dog, Rex. <br><br>When the dog is broughtby the Indians the cowboy strokes and pets his companion and whispers something into his ear. <br><br>At once the dog bounds and runsthrough the Indian village and over the hill. <br><br>This does notparticularly distress the Indians as they didn&apos;t really know whatto do with the dog anyway. <br><br>At about 8 o&apos;clock that evening the dog returns accompanied bysome two dozen hookers from the closest town. <br><br>Needless to say the braves were delighted at the prospect of an evening&apos;s entertainment. <br><br>As the orgy wore on through the night, the chief told the cowboy that his stake burning was being postponed as they were all tootired from partying. <br><br>The next day, the chief said to the cowboy, &#x201C;in gratitude forfurnishing the ladies last night, I&apos;m going to grant you anotherrequest before you are burned at the stake in the morning. &#x201D; Again the cowboy requests to see his faithful dog. When the dog isbrought forth the cowboy again strokes and pets his companion and whispers into his ear, &#x201C;this may be my last chance Rex, soplease get it right this time - go to town and get the posse!&#x201D;",
