        "title": "Mother in law misses train",
        "body": "A mother-in-law visits her son-in-law before leaving for a trip. <br><br>They are sipping coffee and chatting. <br><br>Suddenly, mother-in-law looks at the clock and jumps off her chair exclaiming, &#x201C;My god!  It&apos;s already three P. M. I&apos;m about to miss my train!&#x201D; She begins to put her clothes on in a hurry. At this moment, the son-in-law&apos;s daughter runs up to her and before he can do anything and announces, &#x201C;Don&apos;t hurry, granny!  Daddy moved the clock two hours ahead!&#x201D;",
