        "_id": "Da4d333BiChJe3mmd",
        "title": "Things adults learn from kids:",
        "body": "There is no such thing as child-proofing your house. <br><br>If you spray hair spray on dust bunnies and run over them with roller blades, they can ignite. <br><br>A 4 years-old&apos;s voice is louder than 200 adults in a crowded restaurant. 4.If you hook a dog leash over a ceiling fan the motor is not strong enough to rotate a 42 pound boy wearing pound puppy underwear and a superman cape. <br><br>It is strong enough however to spread paint on all four walls of a 20 by 20 foot room. <br><br>Baseballs make marks on ceilings. <br><br>You should not throw baseballs up when the ceiling fan is on. <br><br>When using the ceiling fan as a bat you have to throw the ball up a few times before you get a hit. <br><br>A ceiling fan can hit a baseball a long way. <br><br>The glass in windows (even double pane) doesn&apos;t stop a baseball hit by a ceiling fan. <br><br>When you hear the toilet flush and the words &#x201C;Uh-oh&#x201D; it&apos;s already too late. <br><br>Brake fluid mixed with Clorox makes smoke, and lots of it. <br><br>A six year old can start a fire with a flint rock even though a 36 year old man says they can only do it in the movies. <br><br>A magnifying glass can start a fire even on an overcast day. <br><br>If you use a waterbed as home plate while wearing baseball shoes it does not leak<br><br> - it explodes. <br><br>A king size waterbed holds enough water to fill a 2000 sq foot house 4 inches deep. <br><br>Legos will pass through the digestive tract of a four year old. <br><br>Duplos will not. <br><br>Play Dough and Microwave should never be used in the same sentence. <br><br>Super glue is forever. <br><br>McGyver can teach us many things we don&apos;t want to know. <br><br>Ditto Tarzan. <br><br>No matter how much Jello you put in a swimming pool you still can&apos;t walk on water. <br><br>Pool filters do not like Jello. <br><br>VCR&apos;s do not eject PB+J sandwiches even though TV commercials show they do. <br><br>Garbage bags do not make good parachutes. <br><br>Marbles in gas tanks make lots of noise when driving. <br><br>You probably do not want to know what that odor is. <br><br>Always look in the oven before you turn it on. <br><br>Plastic toys do not like ovens. <br><br>The fire department in San Diego has at least a 5 minute response time. <br><br>The spin cycle on the washing machine does not make earth worms dizzy. <br><br>It will however make cats dizzy. <br><br>Cats throw up twice their body weight when dizzy. <br><br>Quiet does not necessarily mean don&apos;t worry. <br><br>A good sense of humor will get you through most problems in life (unfortunately, mostly in retrospect). <br><br>",
