        "_id": "DgDv2vQLwecs4uZ4a",
        "title": "Mom's brownies recipe",
        "body": "Mom&apos;s Brownies Recipe... Remove teddy bear from oven and preheat oven to 375. Melt 1 cup margarine in saucepan. <br><br>Remove teddy bear from oven and tell Jr &#x201C;no, no. &#x201D; Add margarine to 2 cups sugar. <br><br>Take shortening can away from Jr. <br><br>and clean cupboards. <br><br>Measure 1/3 cup cocoa. <br><br>Take shortening can away from Jr. <br><br>again and ba the cat. <br><br>Apply antiseptic and bandages to scratches sustained while removing shortening from cat&apos;s tail. <br><br>Assemble 4 eggs, 2 tsp. <br><br>vanilla, and 1-1/2 cups sifted flour. <br><br>Take smoldering teddy bear from oven and open all doors and windows for ventilation. <br><br>Take telephone away from Billy and assure party on the line the call was a mistake. <br><br>Call operator and attempt to have direct dialed call removed from bill. <br><br>Measure 1 tsp. <br><br>salt, 1/2 cup nuts and beat all ingredients well. <br><br>Let cat out of refrigerator. <br><br>Pour mixture into well-greased 9x13-inch pan. <br><br>Bake 25 minutes. <br><br>Rescue cat and take razor away from Billy. <br><br>Explain to kids that you have no idea if shaved cats will sunburn. <br><br>Throw cat outside while there&apos;s still time and he&apos;s still able to run away. <br><br>FrostingMix the following in saucepan: 1 cup sugar 1 oz unsweetened chocolate 1/4 cup margarine Take the darn teddy bear out of the @#$% broiler and throw it away  far away. <br><br>Answer the door and meekly explain to nice policeman that you didn&apos;t know Jr had slipped out of the house and was heading for the street. <br><br>Put Jr in playpen. <br><br>Add 1/3 cup milk, dash of salt, and boil, stirring constantly for 2 minutes. <br><br>Answer door and apologize to neighbor for Billy having stuck a garden hose in man&apos;s front door mail slot. <br><br>Promise to pay for ruined carpet. <br><br>Tie Billy to clothesline. <br><br>Remove burned brownies from oven",
