        "_id": "E5uodjLk48DJZ2gGf",
        "title": "The animal's warning",
        "body": "A farmer and his pig were driving down the road when a cop pulled him over. <br><br>The cop asked the farmer, &#x201C;Didn&apos;t you know it is against the law to ride with a pig in the front of you truck?&#x201D; The farmer replied, &#x201C;No, I didn&apos;t knowed that.&#x201D; The cop ask the farmer where he was going and he said, &#x201C;To Memphis&#x201D; . The cop said, &#x201C;I will let you off the hook this time if you promise to take the pig to the zoo when you get to Memphis. &#x201D; So the farmer promised he would. Several days later the cop spotted the farmer with the pig driving down the road and he pulled him over again. The cop said &#x201C;I thought I told you to take this pig to the zoo when you got to Memphis&#x201D; and to this the farmer replied &#x201C;I did and we had so much fun, I&apos;m taking him to the circus. &#x201D;",
