        "_id": "ECDApCxfcnpd7o4Yd",
        "title": "Little johnny at the neighbors...",
        "body": "Little Johnny &apos;s next door neighbors had a baby. <br><br>Unfortunately, the little baby was born with no ears. <br><br>When they arrived home from the hospital, the parents invited Little Johnny&apos;s family to come over and see their new baby. <br><br>Little Johnny&apos;s parents were very afraid that their son would have a wise crack to say about the baby so the dad had a long talk with little Johnny before going to the neighbors. <br><br>He said &#x201C;Now, son... that poor baby was born without any ears. I want you to be on your best behavior and not say one word about his ears or I am really going to spank you when we get back home.&#x201D;<br><br>&#x201C;I promise not to mention his ears at all&#x201D; said Little Johnny. At the neighbors home, Little Johnny leaned over in the crib and touched the baby&apos;s hand He looked at it&apos;s mother and said &#x201C;Oh What a Beautiful little baby&#x201D; . The mother said &#x201C;Thank you very much, Little Johnny. &#x201D; He then said, &#x201C;this baby has perfect little hands and perfect little feet. Why... just look at his pretty little eyes.... Did his doctor say that he can see good?&#x201D; The Mother said &#x201C;why, yes Johnny... his doctor said he has 20/20 vision. <br><br>Little Johnny said &#x201C;well, its a darn good thing, cause he sure couldn&apos;t wear glasses!!! <br><br>",
