        "_id": "EJBwLQpZ74Zmgt43D",
        "title": "Children's prayers",
        "body": "I had been teaching my three-year old daughter the Lord&apos;s Prayer. <br><br>For several evenings at bedtime, she would repeat after me the lines from the prayer. <br><br>Finally, she decided to go solo. <br><br>I listened with pride as she carefully enunciated each word, right up to the end of the prayer: &#x201C;Lead us not into temptation, &#x201D; she prayed, &#x201C;but deliver us some E-mail. <br><br>Amen. &#x201D; And one particular four-year old prayed, &#x201C;And forgive us our trash baskets as we forgive those who put trash in our baskets. &#x201D; A little boy was overheard praying: &#x201C;Lord, if you can&apos;t make me a better boy, don&apos;t worry about it. <br><br>I&apos;m having a real good time like I am. &#x201D; A Sunday school teacher asked her little children, as they were on the way to church service, &#x201C;And why is it necessary to be quiet in church?&#x201D; One bright little girl replied, &#x201C;Because people are sleeping.&#x201D; <br><br>The preacher was wired for sound with a lapel microphone, &amp; as he preached, he moved briskly about the platform, jerking the mike cord as he went. <br><br>Then he moved to one side, getting wound up in the cord &amp; nearly tripping before jerking it again. <br><br>After several circles &amp; jerks, a little girl in the third pew leaned toward her mother &amp; whispered, &#x201C;If he gets loose, will he hurt us?&#x201D; Six-year old Angie &amp; her four-year old brother Joel were sitting together in church. Joel giggled, sang &amp; talked out loud. Finally, his big sister had had enough. &#x201C;You&apos;re not supposed to talk out loud in church.&#x201D;<br><br>&#x201C;Why?  Who&apos;s going to stop me?&#x201D; Joel asked. Angie pointed to the back of the church &amp; said, &#x201C;See those two men standing by the door?  They&apos;re hushers. &#x201D; A mother was preparing pancakes for her sons, Kevin, 5, and Ryan, <br>\r\n3. The boys began to argue over who would get the first pancake. <br><br>Their mother saw the opportunity for a moral lesson. <br><br>&#x201C;If Jesus were sitting here, He would say &apos;Let my brother have the first pancake, I can wait&apos;&#x201D; . <br><br>Kevin turned to his younger brother &amp; said, &#x201C;Ryan, you be Jesus!&#x201D; A father was at the beach with his children when his four-year old son ran up to him, grabbed his hand, &amp; led him to the shore, where a seagull lay dead in the sand. &#x201D; Daddy, what happened to him?&#x201D; the son asked. <br><br>&#x201C;He died &amp; went to Heaven, &#x201D; the dad replied. The boy thought a moment &amp; then said, &#x201C;Did God throw him back down?&#x201D; A Sunday school class was studying the Ten Commandments. They were ready to discuss the last one. The teacher asked if anyone could tell her what it was. Susie raised her hand, stood tall, &amp; shouted, &#x201C;Thou shall not take the covers off thy neighbor&apos;s wife. &#x201D; At Sunday School they were teaching how God created everything, including human being s. Little Johnny, a child in the kindergarten class, seemed especially intent when they told him how Eve was created out of one of Adam&apos;s ribs. Later in the week his mother noticed him lying as though he was ill, &amp; asked, &#x201C;Johnny what is the matter?&#x201D; Little Johnny responded, &#x201C;I have a pain in my side. I think I&apos;m going to have a wife!&#x201D; This last one is out of the mouth of my co-workers 3-year old son Reese: &#x201C;Our father, who does art in heaven, Howard is his name.... &#x201D;",
        "tags": [
            "Jokes",
            "Miscellaneous Jokes"
        ],
