        "body": "Yo mama so poor when I saw her kicking a can down the street, I asked her what she was doing, she said &#x201C;Moving. &#x201D; Yo mama so poor she can&apos;t afford to pay attention!  Yo mama so poor when I ring the doorbell I hear the toilet flush!  Yo mama so poor when she goes to KFC, she has to lick other people&apos;s fingers!  Yo mama so poor when I ring the doorbell she says, &#x201C;DING!&#x201D; Yo mama so poor she went to McDonald&apos;s and put a milkshake on layaway. Yo mama so poor your family ate cereal with a fork to save milk. Yo mama so poor her face is on the front of a foodstamp. Yo mama so poor she was in K-Mart with a box of Hefty bags. I said, &#x201C;What ya doin&apos;?&#x201D; She said, &#x201C;Buying luggage. &#x201D; Yo mama so poor she drives a peanut. <br><br>Yo mama so poor she waves around a popsicle stick and calls it air conditioning. <br><br>",
