        "_id": "F5Dofsi8GeQ6i7yC6",
        "title": "Some scientific exploration",
        "body": "Recently, Germany conducted some scientific exploration involving their best scientists. <br><br>Core drilling samples of earth were taken to a depth of 50m and during the core examinations, small pieces of copper were discovered. <br><br>After running many arduous tests on these samples, the German government announced that the ancient Germans 25, 000 years ago had a nationwide telephone network. <br><br>Naturally, the British government was not that easily impressed. <br><br>So they ordered their own scientists to take their core samples at a depth of 100m. <br><br>From these samples, they found small pieces of glass and soon announced that the ancient Brits 35, 000 years ago already had a nationwide optical fibre network. <br><br>Irish scientists were outraged. <br><br>So immediately after this announcement, they ordered their scientist to take samples at a depth of 200m but found absolutely nothing. <br><br>They concluded that the ancient Irish 55, 000 h years ago were an even more advanced civilisation, as they already had a mobile telephone network in place. <br><br>",
