        "_id": "FYLE7E7N2cvebe8MQ",
        "title": "Celebrating blondes",
        "body": "A group of blondes walks into a bar, all excited and giggling. <br><br>They order a round of drinks. <br><br>One of the blondes raises her glass and shouts excitedly, &#x201C;51!!&#x201D;<br><br>&#x201C;51!!&#x201D; The other blondes echo. After they have finished their drinks, another round is ordered. Again, the blondes toast &#x201C;51&#x201D; . This happens a few times. Finally, the bartender speaks up. &#x201D; Excuse me, &#x201D; He says, &#x201C;But why do you ladies keep doing that?&#x201D;<br><br>&#x201C;Well, &#x201D; Says one of the blondes, very bubbly, &#x201C;We got a puzzle, right?  And it said 2-4 years on the box. We finished it in 51 days!!!!!&#x201D;",
