        "_id": "FjuPNKqmwAM9pKort",
        "title": "Old man's sperm cup",
        "body": "There was an elderly man who wanted to make his younger wife pregnant. <br><br>So, he went to the doctor to have a sperm count done. <br><br>The doctor told him to take a specimen cup home, fill it, and bring it back the next day. <br><br>The elderly man came back the next day and the specimen cup was empty and the lid was on it. <br><br>Doctor: What was the problem? <br><br> Elderly man: Well, I tried with my right hand... nothing. <br><br>So, I tried with my left hand... nothing. <br><br>My wife tried with her right hand... nothing. <br><br>Her left hand... nothing. <br><br>Her mouth... nothing. <br><br>Then my wife&apos;s friend tried. <br><br>Right hand, left hand, mouth.... still nothing. <br><br>Doctor: Wait a minute. <br><br>You mean your wife&apos;s friend too?! <br><br>Elderly man: Yeah, and we still couldn&apos;t get the lid off of the specimen cup. <br><br>",
