        "title": "Canadian history lesson",
        "body": "On my last trip to Canada, I had the rare pleasure of meeting the leading historian of this great country. <br><br>Out of curiosity I asked him how their county got it&apos;s name. <br><br>Below is his explanation... There were three explorers, hiking through what is now known as Canada. <br><br>&#x201C;You know,&#x201D; said the first explorer, &#x201C;we should name this place we&apos;re hiking through.&#x201D;<br><br>&#x201C;I agree,&#x201D; said the second explorer. &#x201D; Great idea&#x201D; quipped the third explorer. &#x201C;We&apos;ll each pick a letter and then make a name out of that.&#x201D;<br><br>&#x201C;Okay,&#x201D; said the third, &#x201C;I&apos;ll go first. C, eh.&#x201D; The second said: &#x201C;N, eh.&#x201D; The first... &#x201D; D, eh. &#x201D; And now you know the story. <br><br>",
