        "title": "Three blonds on death row",
        "body": "Three women are about to be executed for crimes. <br><br>One&apos;s a brunette, one&apos;s a redhead, and one&apos;s a blonde. <br><br>Two guards brings the brunette forward, and the executioner asks if she has any last requests. <br><br>She says no, and the executioner shouts, &#x201C;Ready ... Aim ... &#x201D; Suddenly the brunette yells, &#x201C;earthquake!!&#x201D; Everyone is startled and looks around. <br><br>She manages to escape. <br><br>The angry guards then bring the redhead forward, and the executioner asks if she has any last requests. She says no, and the executioner shouts, &#x201C;Ready ... Aim ...&#x201D; The redhead then screams, &#x201C;tornado!!&#x201D; Yet again, everyone is startled and looks around. She too escapes execution. By this point, the blonde had figured out what the others did. The guards bring her forward, and the executioner asks if she has any last requests. She also says no, and the executioner shouts, Ready ... Aim ...&#x201D; The blonde shouts, &#x201C;fire!!&#x201D;",
