        "_id": "GzmMsL2SCD9mmf5gB",
        "title": "Wooden leg",
        "body": "Harry was delighted when he found a young woman who accepted his proposal of marriage as he was sensitive about his wooden leg and a bit afraid no one would have him. <br><br>In fact, he couldn`t bring himself to tell his fiancee` about his leg when he slipped the ring on her finger, nor when she bought the dress, nor when they picked the time and place. <br><br>All he kept saying was, &#x201C;Darling, I`ve got a big surprise for you, &#x201D; at which she blushed and smiled bewitchingly. The wedding night came and went, and the young couple were at last alone in their hotel room. &#x201D; Now don`t forget, Harry, you promised me a big surprise,&#x201D; said the bride. Unable to say a word, Harry turned out the lights, unstrapped his wooden leg, slipped into bed, and placed his wife`s hand on the stump. &#x201D; Hmmmmm,&#x201D; she said softly, &#x201C;that IS a surprise. But pass me the Vaseline and I`ll see what I can do!&#x201D;",
