        "_id": "HXfoErCReStRziwsL",
        "title": "A negro was travelling in china...",
        "body": "A negro was travelling in china. <br><br>In a remote village, he came upon an   elderly chinaman   skipping stones across a lake. <br><br>At each bounce of the stone off the   water, the mountains   surrounding the lake echoed back, &#x201C;CHING... CHANG... CHUN... &#x201D; The negro was amazed. He asked the chinaman what was going on.   &#x201C;Oh&#x201D; , said the chinee, &#x201C;magic spirit of the lake echo back the names   of your ancient   ancestors as your stone skip upon the sacred waters&#x201D; .  &#x201C;Wow&#x201D; , said the negro, &#x201C;can I try it?&#x201D; .  &#x201C;Certainly&#x201D; , replied the chinaman.   The negro picked up the biggest stone he could find, and gave it a   mighty heave across the   waters... and as it skipped across the waters, the mountains echoed   back   &#x201C;CHIM... PAN... ZEE.... &#x201D;",
