        "_id": "Hi4ftGzNG6vTxZpoB",
        "title": "Blonde on a cruise!",
        "body": "A Blonde walks into a Restaraunt, and she goes straight to the bulletin board in the back. <br><br>She looks at the bulletin board and sees a piece of paper that sais &#x201C;Ocean Cruise Only 5$&#x201D; . <br><br>She pulls the piece of paper off the wall and goes to the address listed on the back of paper. <br><br>She walks into the building and hands the secretary the piece of paper. <br><br>The secretary nods and asks if she had the five dollars. The blonde nods and pulls five dollars out of her pocket and hands it to the secretary. The secretary looks over to a burly black guy reading a news paper. She nods to the black guy. He stands up and knocks the blonde unconcious. When the blonde wakes up, she&apos;s tied to a log and is floating down river. She started to think that this was a bad idea, when all of a sudden she sees one of her friends, (who is also blonde) tied to a log floating right next to her. The blonde she looks at her freind and says &#x201C;So do you think they&apos;re going to serve us some food on this trip?&#x201D; And the other blonde replies &#x201C;They didn&apos;t serve any last year?&#x201D;",
