        "_id": "HvnSEbocj2ptRvBCi",
        "title": "Driving test answers",
        "body": "The following are a sampling of REAL answers received on exams given by the California Department of Transportation&apos;s driving school. <br><br><br>\r\nQ: Do you yield when a blind pedestrian is crossing the road? <br><br> <br>\r\nA: What for? <br><br> He can&apos;t see my license plate. <br><br><br>\r\nQ: Who has the right of way when four cars approach a four-way stop at the same time? <br><br><br>\r\nA: The pick up truck with the gun rack and the bumper sticker saying, &#x201C;Guns don&apos;t kill people. I do. &#x201D;<br>\r\nQ: When driving through fog, what should you use? <br><br> <br>\r\nA: Your car. <br><br><br>\r\nQ: How can you reduce the possibility of having an accident? <br><br> <br>\r\nA: Be too shit-faced to find your keys. <br><br><br>\r\nQ: What problems would you face if you were arrested for drunk driving? <br><br> <br>\r\nA: I&apos;d probably lose my buzz a lot faster. <br><br><br>\r\nQ: What changes would occur in your lifestyle if you could no longer drive lawfully? <br><br><br>\r\nA: I would be forced to drive unlawfully. <br><br><br>\r\nQ: What are some points to remember when passing or being passed? <br><br> <br>\r\nA: Make eye contact and wave &#x201C;hello&#x201D; if he/she is cute. <br><br><br>\r\nQ: What is the difference between a flashing red traffic light and a flashing yellow traffic light? <br><br><br>\r\nA: The color. <br><br><br>\r\nQ: How do you deal with heavy traffic? <br><br> <br>\r\nA: Heavy psychedelics. <br><br><br>\r\nQ: What can you do to help ease a heavy traffic problem? <br><br> <br>\r\nA: Carry loaded weapons. <br><br><br>\r\nQ: Why would it be difficult to be a police officer? <br><br> <br>\r\nA: It would be tough to be a dickhead all day long. <br><br>",
