        "_id": "J3tNyEuB5yPb6tojz",
        "title": "Some police quotes",
        "body": "&#x201D; The handcuffs are tight because they&apos;re new. <br><br>They&apos;ll stretch out after you wear them awhile.&#x201D; <br><br>&#x201C;If you run, you&apos;ll only go to jail tired.&#x201D; <br><br>&#x201C;So, you don&apos;t know how fast you were going. <br><br>I guess that means I can write anything I want on the ticket, huh?&#x201D;<br><br>&#x201C;Yes sir, you can talk to the shift supervisor, but I don&apos;t think it will help. <br><br>Oh, did I mention that I am the shift supervisor?&#x201D;<br><br>&#x201C;Warning! <br><br> You want a warning? <br><br> O. <br><br>K. <br><br>, I&apos;m warning you not to do that again or I&apos;ll give you another ticket.&#x201D; <br><br>&#x201C;The answer to this last question will determine whether you are drunk or not. Was Mickey Mouse a cat or dog?&#x201D;<br><br>&#x201C;Yeah, we have a quota. Two more tickets and my wife gets a toaster oven.&#x201D;<br><br>&#x201C;Life&apos;s tough, it&apos;s tougher if you&apos;re stupid.&#x201D;<br><br>&#x201C;No sir, we don&apos;t have quotas anymore. We used to have quotas, but now we&apos;re allowed to write as many tickets as we want.&#x201D;<br><br>&#x201C;Just how big were those two beers?&#x201D; In God we trust, all others are suspects. &#x201D;",
