        "body": "Q. ) What does it mean when the flag is at half mast at the post office? <br><br> A. ) They&apos;re hiring. <br><br><br>\r\nQ. ) What did the fish say when he hit a concrete wall? <br><br> A. ) &#x201C;Dam. &#x201D; Q. ) How do crazy people go through the forest? <br><br> A. ) They take the psycho path. <br><br><br>\r\nQ. ) What do Eskimos get from sitting on the toilet too long? <br><br> A. ) Polaroids. <br><br><br>\r\nQ. ) What do the letters D. <br><br>N. <br><br>A. stand for? <br><br> A. ) National Dyslexia Association. <br><br><br>\r\nQ. ) What do you call cheese that isn&apos;t yours? <br><br> A. ) Nacho Cheese. <br><br><br>\r\nQ. ) What do you call Santa&apos;s helpers? <br><br> A. ) Subordinate Clauses. <br><br><br>\r\nQ. ) What do you call four bull fighters in quicksand? <br><br> A. ) Quattro sinko. <br><br><br>\r\nQ. ) What do you get from a pampered cow? <br><br> A. ) Spoiled milk. <br><br><br>\r\nQ. ) What do you get when you cross a snowman with a vampire? <br><br> A. ) Frostbite. <br><br><br>\r\nQ. ) What lies at the bottom of the ocean and twitches? <br><br> A. ) A nervous wreck. <br><br><br>\r\nQ. ) What&apos;s the difference between roast beef and pea soup? <br><br> A. ) Anyone can roast beef. <br><br><br>\r\nQ. ) Why are there so many Smiths in the phone book? <br><br> A. ) They all have phones. <br><br><br>\r\nQ. ) What kind of coffee was served on the Titanic? <br><br> A. ) Sanka. <br><br><br>\r\nQ. ) Why do gorillas have big nostrils? <br><br> A. ) Because they have big fingers. <br><br><br>\r\nQ. ) What do you get when you cross a pit bull with a collie? <br><br> A. ) A dog that runs for help ... after it bites your leg off. <br><br><br>\r\nQ. ) What do you call a boomerang that doesn&apos;t work? <br><br> A. ) A stick. <br><br>",
