        "_id": "M6RuxbawzXvAhsfB4",
        "title": "Bragging",
        "body": "A Frenchman and an Italian were seated next to an American on an overseas flight. <br><br>After a few cocktails, the men began discussing their home lives. &#x201D; Last night I made love to my wife four times, &#x201D; the Frenchman bragged, &#x201C;And this morning she made me delicious crepes and she told me how much she adored me.&#x201D;<br><br>&#x201C;Ah, last night I made love to my wife six times, &#x201D; the Italian responded, &#x201C;And this morning she made me a wonderful omelet and told me she could never love another man. &#x201C;When the American remained silent, the Frenchman smugly asked, &#x201C;And how many times did you make love to your wife last night?&#x201D;<br><br>&#x201C;Once, &#x201D; he replied. &#x201C;Only once?&#x201D; the Italian arrogantly snorted. &#x201D; And what did she say to you this morning?&#x201D;<br><br>&#x201C;Don&apos;t stop. &#x201D;",
