        "title": "One day, a diver was enjoying the aquatic world...",
        "body": "One day, a diver was enjoying the aquatic world 20 feet below sea level. <br><br> He noticed a guy at the same depth he was, but he had on no scuba gear whatsoever. <br><br>The diver went below another 20 feet, but the guy joined him a few minutes later. <br><br>The diver went below 25 feet, but minutes later, the same guy joined him. <br><br>This confused the diver, so he took out a waterpro of chalkboard set, and wrote, &#x201C;How the heck are you able to stay under this deep without equipment?&#x201D; The guy took the board and chalk, erased what the diver had written, and wrote, &#x201C;I&apos;m drowning, you moron!&#x201D;",
