        "_id": "MsmNh7A4wdoQL7RSh",
        "title": "Honda, honda!",
        "body": "A businessman was in Japan to make a presentation to the Toyota motor people. <br><br>Needless to say, this was an especially important deal, and it was imperative that he make the best possible impression. <br><br>On the morning of the presentation he awoke to find himself passing gas, in large volumes, with the unpleasant characteristic of sounding like &#x201C;HONDA.&#x201D; <br><br>The man was besides himself. <br><br>Every few minutes &#x201C;HONDA&#x201D; , &#x201C;HONDA&#x201D; .... Unable to stop this aberrant behavior, and in desperate need to terminate these odious and rather embarrassing emissions, he sought a physicians aid. <br><br>After a full examination, the doctor told him that there was nothing inherently wrong with him and that he would just have to wait it out. <br><br>Being unwilling to accept this state of affairs he visited a second and then a third doctor all of whom told him the same thing. Finally one medic suggested that he visit a dentist. Well, although he could not see how a dentist was going to be of any help, he visited one anyway. Lo and behold, the dentist said, &#x201C;Ah, there&apos;s the problem!&#x201D;<br><br>&#x201C;What is it?&#x201D; the man asked. &#x201C;Why you have an abscess,&#x201D; said the dentist. &#x201D; An abscess?  How could that be causing my problem?&#x201D; asked the man. &#x201D; That&apos;s easy, &#x201D; replied the dentist. &#x201C;Why everyone knows... Abscess makes the fart go Honda!&#x201D; (peeeeeeeeyeeeeeeeeew... hahahahahah)",
