        "_id": "QNyfRn9TsBhuGSKoA",
        "title": "The perfect gift!",
        "body": "A guy walked into a pet store looking for a Christmas gift for his wife. <br><br>The storekeeper said he knew exactly what would please her and took a little bird out of its cage. &#x201D; This is Chet,&#x201D; he said, &#x201C;and Chet can sing Christmas carols and songs. &#x201D; Seeing the look of disbelief on the customer&apos;s face, he proceeded to demonstrate. &#x201D; He needs warming up,&#x201D; he said. <br><br>&#x201C;Lend me your cigarette lighter.&#x201D; <br><br>The storekeeper lifted Chet&apos;s left wing and waved the flame lightly under it. <br><br>Immediately, Chet sang: Oh Come, All Ye Faithful. &#x201D; That&apos;s fantastic,&#x201D; said the customer. &#x201D; And listen to this,&#x201D; said the storekeeper, warming Chet&apos;s other wing. <br><br>Chet sang: O Little Town of Bethlehem. &#x201C;Wrap him up,&#x201D; said the customer, &#x201C;I&apos;ll take him!&#x201D; When he got home he greeted his wife: &#x201C;Honey, I can&apos;t wait until Christmas to show you what I got you. This is fantastic. &#x201D; He unwrapped Chet&apos;s cage and showed the bird to his wife. &#x201D; Now, watch and listen. &#x201D; He raised Chet&apos;s left wing and held him over a Christmas candle that was burning on the mantlepiece. Chet immediately began to sing Silent Night. The wife was delighted. As Chet&apos;s right wing was warmed over the flame, he sang Joy To The World. &#x201D; Let me try it,&#x201D; said the wife, seizing he bird. In her eagerness, she held Chet a little too close to the candle flame. Chet began to sing passionately: &#x201C;Chet&apos;s nuts roasting on an open fire!&#x201D;",
