        "title": "Wife helps out the cop",
        "body": "A male driver is pulled over by a cop and the following conversation takes place: Man: What&apos;s the problem officer? <br><br>Cop: You were going at least 75 in a 55 zone. <br><br>Man: No sir, I was going 65. Wife: Oh Harry. <br><br>You were going 80. (Man gives his wife a dirty look.)Cop: I&apos;m also going to give you a ticket for your broken tail light. <br><br>Man: Broken tail light? <br><br> I didn&apos;t know about a broken tail light! <br><br>Wife: Oh Harry, you&apos;ve known about that tail light for weeks. <br><br>(Man gives his wife a dirty look.)Cop: I&apos;m also going to give you a citation for not wearing your seat belt. <br><br>Man: Oh, I just took it off when you were walking up to the car. <br><br>Wife: Oh Harry, you never wear your seat belt. <br><br>Man: Shut your mouth, woman! <br><br>Cop: Ma&apos;am, does your husband always talk to you this way? <br><br>Wife: No, only when he&apos;s drunk. <br><br>",
