        "_id": "SQo6uaAcmmPXvL5N4",
        "title": "Kentucky crazy law",
        "body": "No person shall sell, exchange, offer to sell or exchange, display or possess living baby chicks, ducklings, or other fowl or rabbits which have been dyed or colored<br><br> - nor dye or color any baby chicks, ducklings or other fowl or rabbits<br><br> - nor sell, exchange, offer to sell or exchange or to give away baby chicks, ducklings or other fowl or rabbits, under two months of age in any quantity less than six, except that any rabbit weighing three pounds or more may be sold at an age of six weeks. <br><br>Any person who violates this section shall be fined not less than $100 nor more than $500. <br>\r\n-KRS 436.600 (Passed 1966 Ky. <br><br>Acts ch. 215. sec. 5.) It&apos;s illegal to fish in the Ohio River in Kentucky without an Indiana Fishing License. <br><br>Any person who displays, handles or uses any kind of reptile in connection withany religious service or gathering shall be fined not less than fifty dollars ($50) nor more than one hundred dollars ($100). <br><br><br>\r\n-KRS 437.060 (Passed 1942, from Ky. <br><br>Stat. <br><br>sec. 1267.-1.). <br><br>All bees entering Kentucky shall be accompanied by certificates of health, stating that the apiary from which the bees came was free from contagious or infectious disease. <br><br><br>\r\n-KRS 252.130 (Passed in 1922<br><br> - Repealed in 1948) No person owning or controlling a billiard or pool table shall permit, for compensation or reward, any minor under eighteen (18) years of age to play any game on the table, unless such minor shall have first displayed an identification card containing his name, age, photograph, and the signature of his parents or guardian. <br><br>The minor shall keep such identification card on his person, and it shall be subject to inspection at any time by any peace officer. <br><br>The person owning or controlling such billiard or pool table shall keep and maintain a registration book in which each minor shall sign. <br><br>The person owning or controlling such billiard or pool table shall supply a blank identification card to each parent or guardian who makes request for same. <br><br>Any person who violates this section shall be fined not less than ten ($<br>\r\n10) nor more than one hundred dollars ($100) for each offense. <br><br><br>\r\n-KRS 436.320 (Passed 1893<br><br> - Amended in 1954, Ky. <br><br>Acts ch. 232. sec. <br><br><br>\r\n1) It is illegal to fish with a bow and arrow in Kentucky. <br><br>Any person who appears on any highway, or upon the street of any city that has no police protection, when clothed only in ordinary bathing garb, shall be fined no less than five dollars nor more than twenty-five dollars. &#x201D;<br><br> - KRS 436.140 (Passed in 1922<br><br> - Repealed in 1974) By law, anyone who has been drinking is &#x201C;sober&#x201D; until he or she &#x201C;cannot hold on to the ground. <br><br>&#x201C;It is illegal to transport an ice cream cone in your pocket. <br><br>A woman may not buy a hat without her husband&apos;s permission. <br><br>",
