        "title": "Lawyer's translation",
        "body": "A Mexican bandit made a specialty of crossing the Rio Grande from time to time and robbing banks in Texas. <br><br>Finally, a reward was offered for his capture, and an enterprising Texas ranger decided to track him down. <br><br>After a lengthy search, he traced the bandit to his favorite cantina, snuck up behind him, put his trusty six-shooter to the bandit&apos;s head, and said, &#x201C;You&apos;re under arrest. Tell me where you hid the loot or I&apos;ll blow your brains out. &#x201D; But the bandit didn&apos;t speak English, and the Ranger didn&apos;t speak Spanish. Fortunately, a bilingual lawyer was in the saloon and translated the Ranger&apos;s message. The terrified bandit blurted out, in Spanish, that the loot was buried under the oak tree in back of the cantina. &#x201C;What did he say?&#x201D; asked the Ranger. The lawyer answered, &#x201C;He said &apos;Get lost, Gringo. You wouldn&apos;t dare shoot me! &apos;&#x201D;",
