        "body": "It seems three Irishmen, Sean, Michael and Tim, passed over at the same time. <br><br>Upon encountering the Pearly Gates, they were met by ST. <br><br>Patrick himself, and he addressed the boys thusly: &#x201C;Lads, I&apos;m here to welcome you to heaven where you will spend eternity. <br><br>Just remember one thing, when you go through these gates, don&apos;t step on any of the ducks or you&apos;ll be punished for eternity. Sean went in first and was amazed to see that the entire ladscape was encompassed by ducks, and try as he might, sure enough he stepped on one. He was immediately joined by one of the homliest colleens he&apos;s ever laid eyes on, and she said, &#x201C;Well love, you stepped on a duck and now we&apos;re together for all time. &#x201D; And of course the exact same thing happened to Michael only his companion was even the worse for wear. By this time Tim was absolutely terrified. And he gingerly managed to make it most of the way across the court without stepping on a single duck. Suddenly, his arm was taken by a young lass. Tim looked over and beheld the most beautiful, graceful, blue-eyed woman he&apos;s ever seen in all his life. He gasped, &#x201C;I don&apos;t understand it!&#x201D; The young beauty answered, &#x201C;Well I&apos;m sure I don&apos;t either, I was walking along minding my own business, when all of a sudden I stepped on a duck. &#x201D;",
