        "title": "A present for little johnny!",
        "body": "Little Johnny had a cussing problem and his father was getting tired of it. <br><br>He decided to ask his shrink what to do. <br><br>The shrink said that, since Christmas was coming up that he should ask Johnny what he wanted Santa to bring him. <br><br>If he cussed, he should leave a pile of dog shit in place of the gift. <br><br>Two days before Christmas, Johnny&apos;s dad asked Johnny what he wanted. <br><br>Johnny said, &#x201C;I want a god damned teddy-bear laying right fuckin here beside me when I wake-up Christmas morning. Then, when I go downstairs I want to see a motherfuckin&apos; train going around the god damned tree, and when I go outside I want to see a red-assed fuckin&apos; bike leaning up against the damn garage!&#x201D; Christmas morning, Little Johnny woke up and rolled over into a big pile of dog shit. Confused, he walked downstairs and saw a bunch of dog shit around the Christmas tree. Scratching his head, he walked outside and saw a huge pile of dog shit by the garage. When he walked back inside with a curious look on his face. His dad smiled and asked... &#x201D; So Johnny, what did Santa bring you this year?&#x201D; Johnny replied, &#x201C;I think I got a fuckin&apos; dog but I can&apos;t find the son of a bitch. &#x201D;",
