        "title": "Phone for texas aggie",
        "body": "Soon after the Texas Aggie clocked in for work, the foreman called him over and told him that he had a phone call in the front office. <br><br>When the Aggie returned, he had a mournful expression on his face and his head hung low. <br><br>His foreman noticed and asked if he had received bad news. &#x201D; Shure was, Boss&#x201D; he replied, &#x201C;I just found out that my mother died earlier this morning. &#x201D; Gosh, that&apos;s awful, &#x201D; replied the foreman &#x201C;Do you want the rest of the day off?&#x201D;<br><br>&#x201C;No, &#x201D; replied the Aggie. &#x201C;I&apos;ll finish the day out. &#x201D; About an hour later, the foreman returned to inform him that there was another phone call for him up front. This time when the Aggie returned he looked twice as glum and the foreman asked if everything was alright. &#x201D; Jezz, Boss this has to be the worst day of my life, &#x201D; Moaned the Aggie. &#x201D; That was my brother, and his mother died today too!&#x201D;",
