        "title": "Visiting the sun",
        "body": "A blonde, a brunette, and a redhead, all working for NASA, were trying to figure out where to go on the next trip. <br><br>The brunette said, &#x201C;We should go to Mars.&#x201D; The redhead said, &#x201C;We should go to the Moon.&#x201D; The brunette and the redhead sat there arguing for a while. Suddenly, the blonde shouts, &#x201C;Stop arguing!  I know where the next expedition should be to ... the Sun!&#x201D; The brunette and the redhead looked at each other and started laughing. The brunette finally said, &#x201C;You can&apos;t go to the Sun. You would melt or burn up before you even got close!&#x201D; The blonde said, &#x201C;DUH... Not if you go at night!&#x201D;",
