        "body": "A woman who had been married twice and divorced twice was fed up. <br><br>Her   first husband beat her, and her second husband ran away with another   woman. <br><br>Plus, she couldn&apos;t find a new lover who could satisfy her   sexually, so she put an ad in the classifieds:   Wanted: A good looking, single guy who won&apos;t beat me, won&apos;t leave me,   and is good in bed. <br><br>  About a week later, her doorbell rings. <br><br>She opens the door to find a   man with no arms and legs on her front porch. <br><br>  &#x201C;I&apos;m here about your ad,&#x201D; he says.   &#x201C;You must be mistaken,&#x201D; she said.   &#x201C;Let me explain,&#x201D; he says. &#x201C;I can&apos;t beat you, I don&apos;t have any arms.   And I can&apos;t run away because I don&apos;t have any legs.&#x201D;<br><br>&#x201C;But, &#x201D; she asks, &#x201C;How do I know you&apos;re good in bed?&#x201D;   &#x201C;I rang the doorbell, didn&apos;t I?&#x201D;",
