        "_id": "a39gGL2FMYf893PDg",
        "title": "Lovely gift",
        "body": "A young man wanted to purchase a gift for his new sweetheart&apos;s birthday, and as they had not been dating very long, after careful consideration he decided a pair of gloves would strike just the right note: romantic, but not too personal. <br><br>Accompanied by his sweetheart&apos;s younger sister, he went to Nordstrom&apos;s and bought a pair of white gloves. <br><br>The sister purchased a pair of panties for herself. <br><br>During the wrapping the clerk mixed up the items and the sister got the gloves and the sweetheart got the panties. <br><br>Without checking the bodys, the young man sealed the package and sent it to his sweetheart along with this note: I chose these because I noticed that you are not in the habit of wearing any when we go out in the evening. <br><br>If it had not been for your sister I would have chosen the long ones with the buttons, but she wears the short ones that are easier to remove. <br><br>These are a delicate shade, but the lady I bought them from showed me the pair she had been wearing for the past three weeks and they were hardly soiled. <br><br>I had her try yours on for me and she looked really smart. <br><br>I wish I was there to put them on for you the first time, as no doubt other hands will come in contact with them before I have a chance to see you again. <br><br>When you take them off, remember to blow in them before putting them away as they will naturally be a little damp from wearing. <br><br>Just think how many times I will kiss them during the coming year. <br><br>I hope you will wear them for me on Friday night. <br><br>All my love, P. <br><br>S. <br><br>The latest style is to wear them folded down with a little fur showing. <br><br>",
