        "_id": "av7WsWeevdrFYPYbA",
        "title": "The signalman's test!",
        "body": "Tom is applying for a job as a signalman for the local railroad, and is told to meet the inspector at the signal box. <br><br>The inspector decides to give Tom a pop quiz, asking, &#x201C;What would you do if you realized that two trains were heading towards each other on the same track?&#x201D; Tom says, &#x201C;I would switch one train to another track.&#x201D; <br><br>&#x201C;What if the lever broke?&#x201D; asks the inspector. &#x201C;I&apos;d run down to the tracks and use the manual lever, &#x201D; answers Tom. &#x201C;What if that had been struck by lightning?&#x201D; challenges the inspector. &#x201D; Then, &#x201D; Tom continues, &#x201C;I&apos;d run back up here and use the phone to call the next signal box.&#x201D;<br><br>&#x201C;What if the phone was busy?&#x201D;<br><br>&#x201C;In that case, &#x201D; Tom argues, &#x201C;I&apos;d run to the street level and use the public phone near the station&#x201D; . &#x201C;What if that had been vandalized?&#x201D;<br><br>&#x201C;Oh, well,&#x201D; says Tom, &#x201C;in that case I&apos;d run into town and get my Uncle Leo. &#x201D; This puzzles the inspector, so he asks, &#x201C;Why would you do that?&#x201D;<br><br>&#x201C;Because he&apos;s never seen a train crash!&#x201D;",
