        "_id": "bSFzCH2cRFcsG8to6",
        "title": "Show him your cross",
        "body": "Two nuns, Sister Mary Agnes and Sister Mary Vincent, aretraveling through Europe in their car, sightseeing inTransylvania. <br><br> As they are stopped at a traffic light, outof nowhere, a small vampire jumps on to the hood of the car and hisses at them through the windshield. &#x201D; Quick, quick!&#x201D; shouts Sister Mary Agnes, &#x201C;What should wedo?&#x201D;<br><br>&#x201C;Turn the windshield wipers on. <br><br> That will get rid of theabomination,&#x201D; says Sister Mary Vincent. Sister Mary Agnes switches on the wipers, which knock themini-Dracula around.  But, he hangs on and continues hissingat the nuns.  &#x201C;What shall I do now?&#x201D; she shouts. &#x201D; Try the windshield washer.  I filled it with holy waterbefore we left the Vatican, &#x201D; replies Sister Mary Vincent. Sister Mary Agnes turns on the windshield washer.  The vampire screams as the water burns his skin, but he hangs onand continues hissing at the nuns. &#x201D; Now what?&#x201D; shouts Sister Mary Agnes. &#x201D; Show him your cross,&#x201D; says Sister Mary Vincent. &#x201D; Now you&apos;re talking,&#x201D; says Sister Mary Agnes.  She thenopens the window and shouts, &#x201C;Get the fuck off our car!&#x201D;",
