        "title": "On the porch",
        "body": "Two elderlies are rocking on the porch at the home. &#x201D; Bet you can&apos;t guess how old I am,&#x201D; he says. <br><br>&#x201C;Bet I can,&#x201D; she said. <br><br>&#x201C;Bet you fifty dollars you can&apos;t tell me how old I am,&#x201D; he says. <br><br>&#x201C;You&apos;re on,&#x201D; she said. <br><br>&#x201C;Stand up. &#x201D; He stands up. She looks him up and she looks him down. &#x201D; Now turn around,&#x201D; she said. She looks him up and she looks him down. &#x201D; Now, turn back around ... and drop your pants,&#x201D; she said. He drops his pants and she looks him up ... and she looks him down ... &#x201C;You&apos;re 86,&#x201D; she said. He&apos;s dumbounded. &#x201D; By golly, woman, you&apos;re right. I am 86. How&apos;d you know?&#x201D; She rocks and smiles. &#x201C;You told me yesterday!&#x201D;",
