        "title": "Some years ago",
        "body": "Some years ago, Michael J. <br><br>Flanagan, a successful New York contractor, was standing on the deck of the Staten Island Ferry when a car got loose and sent him into the river where he drowned. <br><br>The following Sunday his widow, all decked out in deepest black, was standing on the church steps after Mass, receiving condolences and enjoying every minute of it, when an old friend of the contractor came up. <br><br>&#x201C;I&apos;m sorry, Mary, for your trouble, &#x201D; offered the friend. &#x201C;Did Mike leave you well fixed?&#x201D;<br><br>&#x201C;Oh, he did!&#x201D; she said. &#x201C;He left me almost a half million dollars.&#x201D;<br><br>&#x201C;Well now, that&apos;s not bad for a man who couldn&apos;t read or write.&#x201D;<br><br>&#x201C;Nor swim either, &#x201D; added the widow. <br><br>",
