        "_id": "cKyzXrrr7dtxtMYK8",
        "title": "The interview.",
        "body": "Note: This is an extract of a National Public Radio (NPR) interview between a female broadcaster, and US Army General Reinwald who was about to sponsor a Boy Scout Troop visiting his military installation. <br><br>INTERVIEWER: &#x201C; So, General Reinwald, what things are you going to teach these young boys when they visit your base?&#x201D; GENERAL REINWALD: We&apos;re going to teach them climbing, canoeing, archery, and shooting. &#x201C;INTERVIEWER: &#x201C;Shooting!  that&apos;s a bit irresponsible, isn&apos;t it?&#x201D; GENERAL REINWALD: &#x201C;I don&apos;t see why, they&apos;ll be properly supervised on the rifle range. &#x201C;INTERVIEWER: &#x201C;Don&apos;t you admit that this is a terribly dangerous activity to be teaching children?&#x201D; GENERAL REINWALD: &#x201C;I don&apos;t see how, .... we will be teaching them proper rifle discipline before they even touch a firearm. &#x201C;INTERVIEWER: &#x201C;But you&apos;re equipping them to become violent killers. &#x201D; GENERAL REINWALD: &#x201C;Well, you&apos;re equipped to be a prostitute, but you&apos;re not one, are you?&#x201D; The radio went silent and the interview ended. <br><br>",
