        "title": "Soldier stands guard",
        "body": "A new soldier was on sentry duty at the main gate. <br><br>His orders were clear. <br><br>No car was to enter unless it had a special sticker on the windshield. <br><br>A big Army car came up with a general seated in the back. <br><br>The sentry said, &#x201C;Halt, who goes there?&#x201D; The chauffeur, a corporal, says, &#x201C;General Wheeler.&#x201D;<br><br>&#x201C;I&apos;m sorry, I can&apos;t let you through. You&apos;ve got to have a sticker on the windshield.&#x201D; The general said, &#x201C;Drive on!&#x201D; The sentry said, &#x201C;Hold it!  You really can&apos;t come through. I have orders to shoot if you try driving in without a sticker.&#x201D; The general repeated, &#x201C;I&apos;m telling you, son, drive on!&#x201D; The sentry walked up to the rear window and said, &#x201C;General, I&apos;m new at this. Do I shoot you or the the driver?&#x201D;",
