        "_id": "dBrAdGkqa5Pn73mfw",
        "title": "A pregnant woman is about to give birth...",
        "body": "A pregnant woman is about to give birth. <br><br>The doctor has her on the delivery table, legs up in the stirrups. <br><br>Suddenly, he sees the topof a head push through. <br><br>Then the baby pops its head out and says to the doctor, &#x201C;Are you my dad?&#x201D; . <br><br>The doctor says, &#x201C;No, I am your doctor!&#x201D; . <br><br>With that, the baby popsright back inside. &#x201D; Damn!&#x201D; , says the doctor. A short while later he sees the head pushthrough again. &#x201C;Are you my dad?&#x201D; , asks the baby. &#x201D; No, I am your doctor. &#x201D;, he replies. Once again the baby vanishes back into his mother&apos;s womb. The doctor turns to a nurse and says, &#x201C;Nurse, get that baby&apos;s fatherin here right away we may have a situation on our hands!&#x201D; . Momentslater the baby&apos;s father is in the delivery room, and the baby&apos;s headonce again pops out. &#x201C;Are you my dad?&#x201D; , the baby asks of the father. The father replies, &#x201C;Yes, little baby, I am your father!&#x201D; The baby then reaches up and begins poking his father in the forehead with his index finger&#x201D; How do you like that?&#x201D;",
