        "_id": "dNxt5BbBPdysnmS3R",
        "title": "Real idiots of society!",
        "body": "Here are some people who should not be allowed to venture into society: Police in Wichita, Kansas, arrested a 22-year-old man at an airport hotel after he tried to pass two (counterfeit) $16 bills. <br><br>A man in Johannesberg, South Africa, shot his 49-year-old friend in the face, seriously wounding him, while the two practiced shooting beer cans off each other&apos;s head. <br><br>A company trying to continue its five-year perfect safety record showed its workers a film aimed at encouraging the use of safety goggles on the job. <br><br>According to Industrial Machinery News, the film&apos;s depiction of gory industrial accidents was so graphic that twenty-five workers suffered minor injuries in their rush to leave the screening room. <br><br>Thirteen others fainted, and one man required seven stitches after he cut his head falling off a chair while watching the film. <br><br>The Chico, California, City Council enacted a ban on nuclear weapons, setting a $500 fine for anyone detonating one within city limits. <br><br>A bus carrying five passengers was hit by a car in St. Louis, but by the time police arrived on the scene, fourteen pedestrians had boarded the bus and had begun to complain of whiplash injuries and back pain. <br><br>Swedish business consultant Ulf af Trolle labored 13 years on a book about Swedish economic solutions. <br><br>He took the 250-page manuscript to be copied, only to have it reduced to 50, 000 strips of paper in seconds when a worker confused the copier with the shredder. <br><br>A convict broke out of jail in Washing ton D. <br><br>C., then a few days later accompanied his girlfriend to her trial for robbery. <br><br>At lunch, he went out for a sandwich. <br><br>She needed to see him, and thus had him paged over the courthouse intercom. <br><br>Police officers recognized his name and arrested him as he returned to the courthouse in a car he had stolen over the lunch hour. <br><br>Police in Radnor, Pennsylvania, interrogated a suspect by placing a metal col ander on his head and connecting it with wires to a photocopy machine. <br><br>The message &#x201C;He&apos;s lying&#x201D; was placed in the copier, and police pressed the copy button each time they thought the suspect wasn&apos;t telling the truth. Believing the &#x201C;lie detector&#x201D; was working, the suspect confessed. When two service station attendants in Ionia, Michigan, refused to hand over the cash to an intoxicated robber, the man threatened to call the police. They still refused, so the robber called the police and was arrested. A Los Angeles man who later said he was &#x201C;tired of walking, &#x201D; stole a steamroller and led police on a 5 mph chase until an officer stepped aboard and brought the vehicle to a stop. <br><br>",
        "tags": [
            "Jokes",
            "Miscellaneous Jokes"
        ],
