        "_id": "eC3Y5BWgwMNJN3GtM",
        "title": "Criminal hall of shame",
        "body": "Every day, we are assaulted by stories of stupid people  many of whom use their stupidity for personal gain. <br><br>From time to time, though, we hear of those who strive to achieve new levels of stupidity *while* also breaking the law. <br><br>To these brave men and women  ooops, &#x201C;women and men&#x201D;  we present the highest possible honor: entry into the &#x201C;Stupid-. &#x201D; Following are their accounts .. Kentucky (where else?): Two men tried to pull the front off a cash machine by running a chain from the machine to the bumper of their pickup truck. <br><br>Instead of pulling the front panel off the machine, though, they pulled the bumper off their truck. <br><br>Scared, they left the scene and drove home. <br><br>With the chain still attached to the machine. <br><br>With their bumper still attached to the chain. <br><br>With their vehicle&apos;s license plate still attached to the bumper. <br><br>South Carolina: A man walked into a local police station, dropped a bag of cocaine on the counter, informed the desk sergeant that it was subst andard cut, and asked that the person who sold it to him be arrested immediately. <br><br>Indiana: A man walked up to a cashier at a grocery store and demanded all the money in the register. <br><br>When the cashier handed him the loot, he fledleaving his wallet on the counter. <br><br>England: A German &#x201C;tourist, &#x201D; supposedly on a golf holiday, showed up at customs with his golf bag. <br><br>While making idle chatter about golf, the customs official realized that the tourist did not know what a &#x201C;handicap&#x201D; was. <br><br>The customs official asks the tourist to demonstrate his swing, which he doesbackward! <br><br> A substantial amount of narcotics were found in the golf bag. <br><br>Germany: Oil of Olay no longer turning the trick for her, a woman decided that she would ba the in the milk of a camel (a modern-day Cleopatra). <br><br>So she stole a camel from the local zoo (where *else* can you find a camel when you need one?) and transported it back to her housewhere she realized that the camel&apos;s name was &#x201C;Otto. &#x201D; Arizona: A company called &#x201C;Guns For Hire&#x201D; stages gunfights for Western movies, etc. One day, they received a call from a 47-year-old woman who wanted to have her husband killed. <br><br>She got 4-1/2 years in jail. <br><br>Texas: A man convicted of robbery worked out a deal to pay $9600 in damages rather than serve a prison sentence. <br><br>For payment, he provided the court a checka *forged* check. <br><br>He got 10 years. <br><br>(Location Unknown): A man went into a drug store, pulled a gun, announced a robbery, and pulled a Hefty-bag face mask over his head and realized that he&apos;d forgotten to cut eyeholes in the mask. (Location Unknown): A man successfully broke into a bank after hours and stoleare you ready for this? the bank&apos;s video camera. While it was recording. Remotely. (That is, the videotape recorder was located elsewhere in the bank, so he didn&apos;t get the videotape of himself stealing the camera.) (Location Unknown): A man successfully broke into a bank&apos;s basement through a street-level window, cutting himself up pretty badly in the process. He then realized that (1) he could not get to the money from where he was, (2) he could not climb back out the window through which he had entered, and (3) he was bleeding pretty badly. So he located a phone and dialed &#x201C;911&#x201D; for help.. Virginia: Two men in a pickup truck went to a new home site to steal a refrigerator. <br><br>Banging up walls, floors, etc. , they snatched a refrigerator from one of the houses, and loaded it on to the pickup. <br><br>The truck promptly got stuck in the mud, so these brain surgeons decided that the refrigerator was too heavy. <br><br>Banging up *more* walls, floors, etc. , they put the refrigerator BACK into the house and returned to the pickup truck only to realize that they locked the keys in the truckso they abandoned it. <br><br>(Location Unknown): A man walked into a Circle-K (a convenience store similar to a 7-11), put a $20 bill on the counter and asked for change. <br><br>When the clerk opened the cash drawer, the man pulled a gun and asked for all the cash in the register, which the clerk promptly provided. <br><br>The man took the cash from the clerk and fled, leaving the $20 bill on the counter. <br><br>The total amount of cash he got from the drawer? <br><br> Fifteen dollars. <br><br>",
