        "_id": "gAHtqbnDmsciXjoog",
        "title": "Hit man",
        "body": "An executive with a new young wife and a yen for golf decided about December one year that he couldn&apos;t take it any longer. <br><br>So he said to his wife one evening, &#x201C;Honey, next Friday we&apos;re going to Hilton Head for the weekend. <br><br>We&apos;ll get a condo on the golf course and I&apos;m going to play golf all weekend.&#x201D; <br><br>&#x201C;That sounds fine, &#x201D; she purred. <br><br>And, sure enough, next Saturday morning at 6 a.m. <br><br>, found him on the golf course, all alone. <br><br>After playing two holes, he noticed a man carrying a golf bag walking toward him across a fairway. <br><br>The exec. <br><br>waited, and the other man arrived, saying, &#x201C;Mind if I play along?&#x201D; The exec. <br><br>said, &#x201C;Fine. <br><br>Glad to have the company. &#x201D; All went well for a couple of holes, until each approached the sixth green. <br><br>When the new fellow laid down his clubs, the cover came off one club. <br><br>The exec. <br><br>noticed, however, that it wasn&apos;t a club at all. <br><br>It was a high powered rifle. <br><br>&#x201C;Whoa,&#x201D; he said. <br><br>&#x201C;That&apos;s a high powered rifle!&#x201D;<br><br>&#x201C;Look,&#x201D; said the other man. <br><br>&#x201C;I&apos;m not out to cause any trouble. <br><br>If you want me to leave, I will. <br><br>No hard feelings.&#x201D; <br><br>&#x201C;No. <br><br>No,&#x201D; said the exec. <br><br>&#x201C;I&apos;m just curious as to why you have a high-powered rifle in your bag.&#x201D; <br><br>The other man pondered for a moment and then said, &#x201C;Well, I&apos;ll tell you. <br><br>It&apos;s my business. <br><br>It&apos;s what I do for a living.&#x201D; <br><br>&#x201C;Wow,&#x201D; said the other. <br><br>&#x201C;I&apos;ve heard about guys like you, but I&apos;ve never met one before.&#x201D; <br><br>&#x201C;Still want me to play?&#x201D; said the other. &#x201D; Sure,&#x201D; said the Erie exec. &#x201D; As a matter of fact, you know, I do a little hunting. <br><br>Would you mind if I look at it?&#x201D; The other man showed him the rifle. <br><br>It was beautifulan inlaid Weatherby with a huge powerful scope mounted on it. <br><br>The exec. <br><br>picked it up, looked through the scope, and said, &#x201C;Gee, I can see the window of my condo with this thing. <br><br>Matter of fact, there&apos;s my wife. &#x201D; He lowered the gun for a moment and said, &#x201C;she doesn&apos;t have any clothes on. &#x201D; He looked through the scope again. &#x201D; Damn, there&apos;s a guy with her.&#x201D; <br><br>The Erie exec. <br><br>lowered the rifle and looked at the other man. <br><br>&#x201C;How much do you charge?&#x201D;<br><br>&#x201C;$10, 000 a bullet,&#x201D; said the man. <br><br>The Erie man thought for a moment, and said, &#x201C;Do it.&#x201D; <br><br>&#x201C;Which one?&#x201D; said the hit man. &#x201D; Both,&#x201D; said the exec. &#x201D; That&apos;s $20, 000, you know.&#x201D; <br><br>&#x201C;I don&apos;t care, hit &apos;em both.&#x201D; <br><br>The hit man took two cartridges from his bag and loaded the rifle. &#x201C;Where do you want me to get the man?&#x201D; he asked. &#x201C;Blow his nuts off&#x201D; said the exec. &#x201C;How about the woman?&#x201D;<br><br>&#x201C;In the mouth. She&apos;s always flapping her gums anyway.&#x201D;<br><br>&#x201C;Ok,&#x201D; said the hit man as he raised the rifle. Taking careful aim, he clicked off the safety, but then he paused and chuckled. &#x201D; Mister,&#x201D; he said, &#x201C;I think I&apos;m going to be able to save you ten thous and dollars. &#x201D;",
        "tags": [
            "Jokes",
            "Miscellaneous Jokes"
        ],
