        "title": "All the strange names",
        "body": "One Day Stupid, Trouble, and Shut Up were driving along in their car when Trouble suddenly hurled himself out of the window. <br><br>Well, Stupid and Shut Up did not know what to do so they went to the police station. <br><br>When they got there the chief asked them their names. &#x201D; Shut Up&#x201D; , replied Shut Up. &#x201D; Stupid&#x201D; , replied Stupid. <br><br>The police chief thought these people were telling him to shut up, and were calling him stupid. <br><br>Which made him very mad. &#x201D; Excuse Me!&#x201D; shouted the chief. <br><br>Thinking the chief was hard of hearing, They once again shouted there names. &#x201D; Shut Up!&#x201D;<br><br>&#x201C;Stupid!&#x201D; The police chief was very riled. He then asked&#x201D; Are you looking for trouble?&#x201D; !!! Stunned at the idea of the chief knowing that they were looking for their friend, they replied, &#x201C;Why yes, how did you know?&#x201D;",
