        "title": "Beautiful  in a sentence",
        "body": "The teacher says, &#x201C;Children, today I will ask each of you to come to the front of the class and use a word in a sentence. Today&apos;s word is &#x201C;beautiful&#x201D; . Little Sally, would you please come up here and use &#x201C;beautiful&#x201D; in a sentence?&#x201D; Little Sally walked to the front of the room, thought for a moment and said, &#x201C;Teacher, my mom is the most beautiful woman in the world. &#x201D; Teacher says, &#x201C;Very good, Little Sally, you may sit. Little Frankie, your turn. &#x201D; Little Frankie walked to the front of the room, thought for a moment and said, &#x201C;Teacher, the sunrise this morning was the most beautiful sunrise I have ever seen. &#x201D; Teacher says, &#x201C;Very good, Little Frankie, you may sit. Little Johnny, it&apos;s your turn. &#x201D; Little Johnnie walked to the front of the room, thought for a moment and said, &#x201C;Teacher, last night my big sister told my dad that she was pregnant and he said, &#x201C;Beautiful, just fucking beautiful. &#x201D;",
