        "title": "An irish priest and a rabbi",
        "body": "An Irish priest and a Rabbi get into a car accident. <br><br>They both get out of their cars and stumble over to the side of the road. <br><br>The Rabbi says, &#x201C;Oy vey!  What a wreck!&#x201D; The priest asks him, &#x201C;Are you all right, Rabbi?&#x201D; The Rabbi responds, &#x201C;Just a little shaken.&#x201D; The priest pulls a flask of whiskey from his coat and says, &#x201C;Here, drink some of this it will calm your nerves.&#x201D; The Rabbi takes the flask and drinks it down and says, &#x201C;Well, what are we going to tell the police?&#x201D;<br><br>&#x201C;Well, &#x201D; the priest says, &#x201C;I don&apos;t know what your aft&apos; to be tellin&apos; them. But I&apos;ll be tellin&apos; them I wasn&apos;t the one drinkin&apos;. &#x201D;",
