        "_id": "hzXQwGTvgaNeMNjxj",
        "title": "Little johnny's parents",
        "body": "One day at school, the teacher sees cuts and bruises all over little johnny&apos;s body. <br><br>Worried, she asks him what happened. <br><br>He replies: &#x201C; Well, my parents are doing renovations in my room and I sleep with them. <br><br>Last night, I woke and heard my father asking OK? <br><br> and mom said OK so I asked OK what?  So they got real angry and beat me up.&#x201D; The next day, the teacher sees new cuts and bruises on little johnny&apos;s body so she asks him what happened and tells her the same thing. So she tells him not to say anything should the same thing occur tonight. Next day at school, little johnny comes to class with a head band on his head and crutches with his face all blue and swollen. When the teacher asks what happened, he says: &#x201C; Like you said, last night, when my dad asked OK?  and mom said OK, I didn&apos;t say anything. After a while, they started moaning and groaning but still, I didn&apos;t say a thing until dad asked: &#x201C;did you come?&#x201D; and mom answered&#x201D; Yeah, I came&#x201D; and I said&#x201D; where were you?&#x201D;",
