        "title": "Knowledge pills",
        "body": "A some what advanced society has figured how to package basic knowledge in pill form. <br><br>A student, needing some learning, goes to the pharmacy and asks what kind of knowledge pills are available. <br><br>The pharmacist says, &#x201C;Here&apos;s a pill for English literature.&#x201D; The student takes the pill and swallows it and has new knowledge about English literature!&#x201D; What else do you have?&#x201D; asks the student. &#x201C;Well, I have pills for art history, biology, and world history, &#x201D; replies the pharmacist. The student asks for these, and swallows them and has new knowledge about those subjects. Then the student asks, &#x201C;Do you have a pill for math?&#x201D; The pharmacist says, &#x201C;Wait just a moment, &#x201D; goes back into the storeroom, brings back a who pper of a pill, and plunks it on the counter. &#x201C;I have to take that huge pill for math?&#x201D; inquires the student. The pharmacist replied, &#x201C;Well, you know math always was a little hard to swallow. &#x201D;",
