        "_id": "iF6WwWW85WHmSwB8P",
        "title": "Doing this great deed",
        "body": "A fellow finds himself in front of the Pearly Gates. <br><br>St. <br><br>Peter explains that its not so easy to get in heaven. <br><br>There are some criteria before entry is allowed. <br><br>For example, was the man religious in life? <br><br> Attend church? <br><br> No? <br><br> St. Peter told him that&apos;s bad. <br><br>Was he generous? <br><br> give money to the poor? <br><br> Charities? <br><br> No? <br><br> St. Peter told him that that too was bad. <br><br>Did he do any good deeds? <br><br> Help his neighbor? <br><br> Anything? <br><br> No? <br><br> St. Peter was becoming concerned. <br><br>Exasperated, Peter says, &#x201C;Look, everybody does something nice sometime. <br><br>Work with me, I&apos;m trying to help. <br><br>Now think!&#x201D; The man says, &#x201C;There was this old lady. I came out of a store and found her surrounded by a dozen Hell&apos;s Angels. They had taken her purse and were shoving her around, taunting and abusing her. I got so mad I threw my bags down, fought through the crowd, and got her purse back. I then helped her to her feet. I then went up to the biggest, baddest biker and told him how despicable, cowardly and mean he was and then spat in his face&#x201D; . &#x201C;Wow&#x201D; , said Peter, &#x201C;That&apos;s impressive. When did this happen ?&#x201D; Oh, about 10 minutes ago&#x201D; , replied the man. <br><br>",
        "tags": [
            "Jokes",
            "Miscellaneous Jokes"
        ],
        "url": "http://www.10000funnyjokes.com/jokes-miscellaneous-41-doing-this-great-deed-5956",
