        "_id": "ikxcCamJ9crBkPbGP",
        "title": "The taxi ride.",
        "body": "A tourist is picked up by a cabbie in New York on a dark night. <br><br>The passenger taps the driver on the shoulder to ask him something. <br><br>The driver screams, loses control of the car, nearly hits a bus, drives up on the sidewalk, and stops inches from a shop window. <br><br>For a second everything went quiet in the cab, then the driver said, &#x201C;Look friend, don&apos;t EVER do that again. You scared the daylights out of me!&#x201D; The passenger apologizes and says he didn&apos;t realize that a &#x201C;little tap&#x201D; could scare him so much. <br><br>The driver, after gathering himself together replied, &#x201C;Sorry, it&apos;s not really your fault. <br><br>Today is my first day as a cab driver<br><br> - I&apos;ve been driving hearses for the last 25 years! <br><br>",
