        "title": "Starch in your shorts",
        "body": "Grampa and Billy were working out in the garden. <br><br>Grampa spies Billy trying to put a worm back into the ground. <br><br>&#x201C;You&apos;ll never get that worm back in his hole,&#x201D; said the old man. <br><br>Suddenly, Billy had an idea. He ran into the laundry room and came back with a can of spray starch. After a few sprays, the worm was as stiff as a board and Billy was able to slide him back into the earth. &#x201D; Billy!  You&apos;re a genius, &#x201D; exclaimed grampa. He hugged Billy, gave him a dollar out of his pocket, grabbed the starch, and ran inside. Thirty minutes later, grampa comes back out smiling. He gives Billy another dollar. &#x201D; Grampa,&#x201D; said the boy, &#x201C;You already gave me a dollar.&#x201D;<br><br>&#x201C;No, &#x201D; replied grampa, &#x201C;That dollar&apos;s from grandma!&#x201D;",
