        "title": "Great to be a woman",
        "body": "Reason&apos;s why it&apos;s great to be a woman Free drinks. <br><br>Free dinners. <br><br>Free movies. <br><br>Speeding ticket? <br><br> What&apos;s that? <br><br> New lipstick gives you a whole new lease on life. <br><br>If you have to be home in time for Melrose Place, you can say so, out loud. <br><br>If you&apos;re not making enough money you can blame the glass ceiling. <br><br>You can sleep your way to the top. <br><br>You can sue the President for sexual harassment. <br><br>It&apos;s possible to live your whole life without ever taking a group shower. <br><br>No fashion faux pas you make could rival The Speedo. <br><br>Brad Pitt. <br><br>No one passes out when you take off your shoes. <br><br>Excitement is only as far away as the nearest beauty-supply store. <br><br>If you forget to shave, no one has to know. <br><br>If you&apos;re dumb, some people will find it cute. <br><br>You have the ability to dress yourself. <br><br>If you marry someone twenty years younger, you&apos;re aware that you look like an idiot. <br><br>You&apos;ll never have to punch a hole through anything with your fist. <br><br>You can quickly end any fight by crying. <br><br>Your friends won&apos;t think you&apos;re weird if you ask whether there&apos;s spinach in your teeth. <br><br>There are times when chocolate really Can solve all your problems. <br><br>You&apos;ve never had a goatee. <br><br>You&apos;ll never regret piercing your ears. <br><br>You can fully assess a person just by looking at their shoes. <br><br>You know which glass was yours by the lipstick mark. <br><br>You get to hate Kathie Lee in the way only another woman truly can. <br><br>",
