        "_id": "jeGQZMG264crcgcZb",
        "title": "Indian chief's signal",
        "body": "An Indian chief is driving his Cadillac somewhere at Nevada. <br><br>Suddenly his car gets broken. <br><br>He examines it, and reveals that a technician must be called. <br><br>But the chief has only $4, and no credit card (unfortunately B-) ). <br><br>So he gathers some wood, makes a fire and signals his tribe with its smoke: &#x201C;Hey, send somebody to my location with $500!&#x201D; The tribe accepts this signal, but to make sure in its meaning, signals back - once again, with the smoke: &#x201C;OK, chief, but why so much ?&#x201D; At this moment a ground test of nuclear bomb is being held on the test field nearby. A huge mushroom-like cloud of smoke rises into the sky... The tribe signals: &#x201C;Ok, Ok, chief, we just wondered, why to be so angry?&#x201D;",
