        "_id": "jkYqmbqzxFo3bHaCt",
        "title": "Clever teacher",
        "body": "A high school English teacher reminds her class of tomorrow&apos;s final exam. &#x201D; Now class, I won&apos;t tolerate any excuses for you not being there tomorrow. <br><br>I might consider a nuclear attack or a serious personal injury or illness, or a death in your immediate family, but that&apos;s it, no other excuses whatsoever. &#x201D; A smart ass guy in the back of the room raises his hand and asks, &#x201C;What would you say if tomorrow I said I was suffering from complete and utter sexual exhaustion?&#x201D; The entire class does its best to stifle their laughter and snickering. When silence is restored, the teacher smiles sympathetically at the student, shakes her head, and sweetly says, &#x201C;Well, I guess you&apos;d have to write the exam with your other hand. &#x201D;",
