        "title": "At school little johnny was told by a classmate...",
        "body": "At school Little Johnny was told by a classmate that most adults are hiding at least one dark secret, and that this makes it very easy to blackmail them by saying, &#x201C;I know the whole truth. &#x201D; Little Johnny decides to go home and try it out. He goes home, and as he is greeted by his mother he says, &#x201C;I know the whole truth. &#x201D; His mother quickly hands him $20 and says, &#x201C;Just don&apos;t tell your father. &#x201D; Quite pleased, the boy waits for his father to get home from work, and greets him with, &#x201C;I know the whole truth.&#x201D; The father promptly hands him $40 and says, &#x201C;Please don&apos;t say a word to your mother. &#x201D;Very pleased, the boy is on his way to school the next day when he sees the mailman at his front door. The boy greets him by saying, &#x201C;I know the whole truth.&#x201D; The mailman immediately drops the mail, opens his arms, and says, &#x201C;Then come give your real father a big hug. &#x201D;",
