        "_id": "jvuLu5CfvwdTMcAEW",
        "title": "Wooo mama!",
        "body": "One day a kid asks his mom if he can take a shower with her. <br><br>She says, &#x201C;Sure son, but don&apos;t look up and don&apos;t look down. &#x201D; So they&apos;re taking a shower and the kid reaches up for the soap and he says, &#x201C;Woo mama! <br><br> What are those?&#x201D; She says, &#x201C;Those are my headlights.&#x201D; <br><br>The kid says &#x201C;Ahh. &#x201D; Then he drops the soap and bends down to get it and he says, &#x201C;Woo mama! <br><br> What is that?&#x201D; and she replies back with, &#x201C;That is my garage.&#x201D; <br><br>The kid says &#x201C;Ahh.&#x201D; The next day he asks his dad if he can take a shower with him. The kid does. As he&apos;s scrubbing himself with the soap, he drops it. When he picks it up he says, &#x201C;Woo daddy!  What is that?&#x201D; The father replies back, &#x201C;That&apos;s my limousine. &#x201D; That night he asks his parents if he could sleep with them and they say, &#x201C;Sure, just don&apos;t look under the covers. &#x201D; Then in the middle of the night he decides to take a peek. And he says &#x201C;Wooo mama!  Look, daddy is parking his limousine in your garage!&#x201D;",
