        "_id": "khERRBmpmsodWhEBA",
        "title": "College rules",
        "body": "On the first day of college, the Dean addressed the students, pointing out some of the rules: &#x201C;The female dormitory will be out-of-bounds for all male students, and the male dormitory to the female students. Anybody caught breaking this rule will be fined $20 the first time. Anybody caught breaking this rule the second time will be fined $60. Being caught a third time will cost you $180. Are there any questions?&#x201D; One student asked, &#x201C;How much for a season pass?&#x201D;",
