        "body": "A partially deaf gentleman was extolling the virtues of his new hearing aid. <br><br>&#x201C;It&apos;s marvelous, &#x201D; he enthused to a friend. &#x201D; Since I acquired it I can hear the birds chirping on the hearth. I can also hear clearly a conversation being held in an apartment a full block away!&#x201D;<br><br>&#x201C;You don&apos;t say,&#x201D; said his friend. &#x201C;What kind is it?&#x201D; The proud owner consulted his wristwatch and answered, &#x201C;Twenty minutes after two. &#x201D;",
