        "_id": "kw3jAfC55J5mSKsth",
        "title": "Emergency doctor visit",
        "body": "A woman rushes to see her doctor, looking very much worried and all strung out. <br><br>She rattles off, &#x201C;Doctor, take a look at me. When I woke up this morning, I looked at my self in the mirror and saw my hair all wiry and frazzled up, my skin was all wrinkled and pasty, my eyes were blood-shot and bugging out, and I had this corpse-like look on my face!  What&apos;s wrong with me, Doctor?&#x201D; The doctor looks her over for a couple of minutes, then calmly says, &#x201C;Well, I can tell you one thing... there ain&apos;t nothing wrong with your eyesight. &#x201D;",
