        "_id": "m6NMbkwsL5pLNP6Af",
        "title": "Fascinating little johnny!",
        "body": "A teacher asked her students to use the word &#x201C;fascinate&#x201D; in a sentence. <br><br>Mary said, &#x201C;My family went to the New York City Zoo, and we saw all the animals. <br><br>It was fascinating.&#x201D; <br><br>The teacher said, &#x201C;That was good, Mary, but I wanted you to use the word &apos;fascinate. &apos;&#x201D; Sally raised her hand and said, &#x201C;My family went to the Philadelphia Zoo and saw the animals. I was fascinated.&#x201D; The teacher said, &#x201C;Good Sally, but I wanted you to use the word &apos;fascinate. &apos;&#x201D; Little Johnny raised his hand. The teacher hesitated because Johnny was notorious for his bad language. She finally decided there was no way he could damage the word &#x201C;fascinate, &#x201D; so she called on him. Johnny said loudly, &#x201C;My sister has a sweater with 10 buttons.&#x201D; The teacher said, &#x201C;That was good, Johnny. However, you did not use the word &apos;fascinate&apos; in your sentence. &#x201D; Little Johnny continued, &#x201C;But her boobs are so big, she can only fasten eight!&#x201D;",
