        "title": "During her annual checkup, the well-constructed miss...",
        "body": "During her annual checkup, the well-constructed miss was asked to disrobe and climb on to the examining table. <br><br>&#x201C;Doctor, &#x201D; she replied shyly, &#x201C;I just can&apos;t undress in front of you.&#x201D;<br><br>&#x201C;All right,&#x201D; said the physician, &#x201C;I&apos;ll flick off the lights. You undress and tell me when you&apos;re through. &#x201C;In a few moments, her voice rang out in the darkness: &#x201C;Doctor, I&apos;ve undressed. What shall I do with my clothes?&#x201D;<br><br>&#x201C;Put them on the chair, on top of mine. &#x201D;",
