        "_id": "mBAgNg9Kz3jgyfwRC",
        "title": "What causes arthritis?",
        "body": "A man who smelled like a distillery flopped on a subway seatnext to a priest. <br><br>The man&apos;s tie was stained, his face wasplastered with red lipstick, and a half-empty bottle of gin was sticking out of his torn coat pocket. <br><br>He opened his newspaper and began reading. <br><br>After a few minutes the disheveled guy turnedto the priest and asked, &#x201C;Say, Father, what causes arthritis?&#x201D;<br><br>&#x201C;My son, it&apos;s caused by loose living, being with cheap, wickedwomen, too much alcohol, and a contempt for your fellow man.&#x201D;<br><br>&#x201C;Well, I&apos;ll be damned, &#x201D; the drunk muttered, returning to his paper. The priest, thinking about what he had said, nudged the man andapologized. &#x201C;I&apos;m very sorry, I didn&apos;t mean to come on so strong. How long have you had arthritis?&#x201D;<br><br>&#x201C;I don&apos;t have it, Father. I was just reading here that the Pope does. &#x201D;",
