        "_id": "mLfocWGGF8mNrw9Fh",
        "title": "Try to catch the rabbit",
        "body": "The Los Angeles Police Department (LAPD), The FBI, and the CIA are all trying to prove that they are the best at apprehending criminals. <br><br>The President decides to give them a test. <br><br>He releases a rabbit into a forest and each of them has to catch it. <br><br>The CIA goes in. <br><br>They place animal informants throughout the forest. <br><br>They question all plant and mineral witnesses. <br><br>After three months of extensive investigations they conclude that rabbits do not exist. <br><br>The FBI goes in. <br><br>After two weeks with no leads they burn the forest, killing everything in it, including the rabbit, and they make no apologies. <br><br>The rabbit had it coming. <br><br>The LAPD goes in. <br><br>They come out two hours later with a badly beaten bear. <br><br>The bear is yelling: &#x201C;Okay!  Okay!  I&apos;m a rabbit!  I&apos;m a rabbit!&#x201D;",
