        "title": "Quote and counter-quote.",
        "body": "Woman&apos;s Quote of the Day: &#x201C;Men are like fine wine. They all start out like grapes, and it&apos;s our job to stomp on them and keep them in the dark until they mature into something with which you&apos;d like to have dinner with. &#x201D; Men&apos;s Counter-Quote of the Day: &#x201C;Women are like fine wine. They all start out fresh, fruity and intoxicating to the mind and then turn full-bodied with age until they go all sour and vinegary and give you a headache. &#x201D;",
