        "_id": "mNpaFD8D3Po7Bsmpg",
        "title": "Funny instruction labels",
        "body": "These are actual instruction labels on consumer goods: On Sears hairdryer: Do not use while sleeping. <br><br>(Gee, that&apos;s the only time I have to work on my hair!) On a bag of Fritos: You could be a winner! <br><br> No purchase necessary. <br><br>Details inside. <br><br>(The shoplifter special!) On a bar of Dial soap: Directions: Use like regular soap. <br><br>(and that would be how?) On some Swann frozen dinners: Serving suggestion: Defrost. <br><br>(But it&apos;s &apos;just&apos; a suggestion!) On Tesco&apos;s Tiramisu dessert: (printed on bottom of the box) Do not turn upside down. <br><br>(Too late! <br><br> you lose!) On Marks and Spencer Bread Pudding: Product will be hot after heating. <br><br>(Are you sure? <br><br> Let&apos;s experiment.) On packaging for a Rowenta iron: Do not iron clothes on body. <br><br>(But wouldn&apos;t that save more time?) (Whose body?) On Boot&apos;s Children&apos;s cough medicine: Do not drive car or operate machinery. <br><br>(We could do a lot to reduce the construction accidents if we just kept those 5 year olds off those fork lifts.) On Nytol sleep aid: Warning: may cause drowsiness. <br><br>(One would hope!) On a Korean kitchen knife: Warning: keep out of children. <br><br>(hmm... something must have gotten lost in the translation... ) On a string of Christmas lights: For indoor or outdoor use only. <br><br>(As opposed to use in outer space.) On a food processor: Not to be used for the other use. <br><br>(Now I&apos;m curious.) On Sainsbury&apos;s peanuts: Warning: contains nuts. <br><br>(but no peas?) On an American Airlines packet of nuts: Instructions: open packet, eat nuts. <br><br>(somebody got paid big bucks to write this one... ) On a Swedish chainsaw: Do not attempt to stop chain with your hands. <br><br>(Raise your hand if you&apos;ve tried this.. ) On a child&apos;s Superman costume: Wearing of this garment does not enable you to fly. <br><br>(Oh go ahead! <br><br> That&apos;s right, destroy a universal childhood belief.)",
        "tags": [
            "Jokes",
            "Miscellaneous Jokes"
        ],
        "url": "http://www.10000funnyjokes.com/jokes-miscellaneous-41-funny-instruction-labels-6100",
