        "_id": "mh9cNpvkEeMh8jvAY",
        "title": "Pretend you're a statue",
        "body": "A woman was in bed with her lover when she heard her husband opening the front door. &#x201D; Hurry!&#x201D; she said, &#x201C;stand in the corner. &#x201D; She quickly rubbed baby oil all over him and then she dusted him with talcum powder. &#x201C;Don&apos;t move until I tell you to, &#x201D; she whispered. &#x201D; Just pretend you&apos;re a statue.&#x201D;<br><br>&#x201C;What&apos;s this, honey?&#x201D; the husband inquired as he entered the room. &#x201D; Oh, it&apos;s just a statue, &#x201D; she replied nonchalantly.&#x201D; The Smiths bought one for their bedroom. I liked it so much, I got one for us too. &#x201C;No more was said about the statue, not even later that night when they went to sleep. Around two in the morning the husband got out of bed, went to the kitchen and returned a while later with a sandwich and a glass of milk. &#x201D; Here,&#x201D; he said to the &apos;statue&apos;, &#x201C;eat something. I stood like an idiot at the Smiths&apos; for three days and nobody offered me as much as a glass of water. &#x201D;",
