        "_id": "oGbBizymaWmEwcqk3",
        "title": "If you are unhappy",
        "body": "Once upon a time, there was a non-conforming sparrow who decided not to fly south for the winter. <br><br>However, soon the weather turned so cold that he reluctantly started to fly south. <br><br>In a short time, ice began to form on his wings and he fell to earth in a barnyard, almost frozen. <br><br>A cow passed by and crapped on the little sparrow. <br><br>The sparrow thought it was the end. <br><br>But, the manure warmed him and defrosted his wings. <br><br>Warm and happy, able to breathe, he started to sing. <br><br>Just then a large cat came by and, hearing the chirping, investigated the sounds. <br><br>The cat cleared away the manure, found the chirping bird and promptly ate him. <br><br>The moral of the story: <br>\r\n1. Everyone who craps on you is not necessarily your enemy. <br><br><br>\r\n2. Everyone who gets you out of the crap is not necessarily your friend. <br><br><br>\r\n3. And, if you&apos;re warm and happy in a pile of crap, keep your mouth shut. <br><br>",
