        "title": "Blonde goes shopping",
        "body": "A blonde went to the appliance store sale and found a bargain. <br><br>&#x201C;I would like to buy this TV, &#x201D; she told the salesman. &#x201D; Sorry, we don&apos;t sell to blondes, &#x201D; he replied. She hurried home and dyed her hair, then came back and again told the salesman &#x201C;I would like to buy this TV.&#x201D;<br><br>&#x201C;Sorry, we don&apos;t sell to blondes, &#x201D; he replied. &#x201C;Darn, he recognized me, &#x201D; she thought. She went for a complete disguise this time, haircut and new color, new outfit, big sunglasses, then waited a few days before she again approached the salesman. &#x201C;I would like to buy this TV. &#x201D; Sorry, we don&apos;t sell to blondes, &#x201D; he replied. Frustrated, she exclaimed &#x201C;How do you know I&apos;m a blonde?&#x201D;<br><br>&#x201C;Because that&apos;s a microwave, &#x201D; he replied. <br><br>",
