        "title": "Famous quotes",
        "body": "One Friday morning, a teacher came up with a novel way to motivateher class. <br><br>She told them that she would read a quote and the firststudent to correctly identify who said it would receive the rest of the day off. <br><br>She started with &#x201C;This was England&apos;s finest hour. &#x201D; Little Suzyinstantly jumped up and said, &#x201C;Winston Churchill.&#x201D;<br><br>&#x201C;Congratulations,&#x201D; said the teacher, &#x201C;you may go home early.&#x201D; The teacher then said, &#x201C;Ask not what your country can do for you, but.. &#x201D; Before she could finish the quote, another young lady beltsout, &#x201C;John F. Kennedy!&#x201D;<br><br>&#x201C;Very good,&#x201D; says the teacher, &#x201C;you may go also. &#x201C;Irritated that he has missed two golden opportunities, Little Johnnysaid, &#x201C;I wish those girls would just shut up. &#x201D;Upon overhearing this comment, the outraged teacher demanded to know who said it. Johnny instantly rose to his feet and said, &#x201C;BillClinton. I&apos;ll see you Monday. &#x201D;",
