        "_id": "pyAWoMRAms43r5rk9",
        "title": "Things in life i've learned.",
        "body": "I&apos;ve learned that you cannot make someone love you. <br><br>All you can do is stalk them and hope they panic and give in. <br><br>I&apos;ve learned that no matter how much I care, some people are just assholes. <br><br>I&apos;ve learned that it takes years to build up trust, and only suspicion, not proof, to destroy it. <br><br>I&apos;ve learned that you can get by on charm for about fifteen minutes. <br><br>After that, you&apos;d better have a big dick or huge tits. <br><br>I&apos;ve learned that you can keep puking long after you think you&apos;re finished. <br><br>I&apos;ve learned that sometimes the people you expect to kick you when you&apos;re down will be the ones who do. <br><br>I&apos;ve learned that no matter how you try to protect your children, they will eventually get arrested and end up in the local paper. <br><br>I&apos;ve learned that the people you care most about in life are taken from you too soon and all the less important ones just never go away. <br><br>I&apos;ve learned to say &#x201C;Fuck &apos;em if they can&apos;t take a joke&#x201D; in 6 languages. Pass this along to 5 friends... trust me, they&apos;ll appreciate it -If not... &#x201D; Fuck &apos;em if they can&apos;t take a joke!&#x201D;",
