        "_id": "qgomDMgRwiWFKFhRj",
        "title": "Dealing with trouble",
        "body": "A deputy police officer responded to a report of a barroom disturbance. <br><br>The &#x201C;disturbance&#x201D; turned out to be well over six feet tall and weighed almost 300 pounds. <br><br>What&apos;s more, he boasted that he could whip the deputy and Muhammad Ali too. <br><br>Said the policeman, &#x201C;I&apos;ll bet that you&apos;re also an escape artist-probably better than Houdini.&#x201D; <br><br>The giant nodded. <br><br>&#x201C;If I had some chains, &#x201D; the deputy continued, &#x201C;you could show us how strong you really are. But all I&apos;ve got is a set of handcuffs. Why don&apos;t you see just how quickly you can break out of them?&#x201D; Once in the cuffs, the man puffed, pulled and jerked for four minutes. &#x201C;I can&apos;t get out of these, &#x201D; the giant growled. &#x201C;Are you sure?&#x201D; the deputy asked. The fellow tried again. &#x201D; Nope, &#x201D; he replied. &#x201C;I can&apos;t do it.&#x201D;<br><br>&#x201C;In that case,&#x201D; said the deputy, &#x201C;you&apos;re under arrest. &#x201D;",
