        "_id": "qqcaqSj8SF2E2SRqa",
        "title": "The price is right",
        "body": "A successful businessman flew to Vegas for a weekend to gamble. <br><br>He lost the shirt off his back and had nothing left but a quarter and the second half of his round-trip air ticket. <br><br>If he could just get to the airport he could get himself home. <br><br>So he went out to the front of the casino where there was a cab waiting. <br><br>He got in and explained his situation to the cabbie. <br><br>He promised tosend the driver money from home, offering his credit card numbers, his driver&apos;s license number and his address but to no avail. <br><br>The cabbie said, &#x201C;If you don&apos;t have $15, get the hell out of my cab. &#x201D; So the businessman was forced to hitchhike to the airport and was barely in time to catch his flight. <br><br>One year later the businessman, having worked long and hard to regain his financial success, returned to Vegas and this time he won big. <br><br>Feeling pretty good about himself, he went out to the front of the casino to get a cab back to the airport. <br><br>Well, who should he see out there, at the end of a long line of cabs, but his old buddy who had refused to give him a ride when he was down on his luck. <br><br>The businessman thought for a moment about how he could make the guy pay for his lack of charity and he hit on a plan. <br><br>The businessman got in the first cab in the line. &#x201C;How much for a rideto the airport?&#x201D; he asked. &#x201C;Fifteen bucks, &#x201D; came the reply. &#x201C;And how much for you to give me a blowjob on the way?&#x201D;<br><br>&#x201C;What?!! Get the hell out of my cab!&#x201D; The businessman got into the back of each cab in the long line and asked the same questions, with the same result. When he got to hisold friend at the back of the line, he got in and asked, &#x201C;How muchfor a ride to the airport?&#x201D; The cabbie replied, &#x201C;Fifteen bucks.&#x201D; The businessman said &#x201C;OK&#x201D; and off they went. <br><br>Then, as they drove slowly past the long line of cabs, the businessmangave a big smile and thumbs-up sign to each driver. <br><br>",
        "tags": [
            "Jokes",
            "Situations Jokes"
        ],
