        "_id": "rGQSC6C3XQtGKzLvr",
        "title": "Outrageous lying",
        "body": "A police officer pulls a guy over for speeding and has the following exchange: Officer: May I see your driver&apos;s license? <br><br>Driver: I don&apos;t have one. <br><br>I had it suspended when I got my 5th DUI. <br><br>Officer: May I see the owner&apos;s card for this vehicle? <br><br>Driver: It&apos;s not my car. <br><br>I stole it. <br><br>Officer: The car is stolen? <br><br>Driver: That&apos;s right. <br><br>But come to think of it, I think I saw the owner&apos;s card in the glove box when I was putting my gun in there. <br><br>Officer: There&apos;s a gun in the glove box? <br><br>Driver: Yes sir. <br><br>That&apos;s where I put it after I shot and killed the woman who owns this car and stuffed her in the trunk. <br><br>Officer: There&apos;s a BODY in the TRUNK?!?!? <br><br>Driver: Yes, sir. <br><br>Hearing this, the officer immediately called his captain. <br><br>The car was quickly surrounded by police, and the captain approached the driver to handle the tense situation: Captain: Sir, can I see your license? <br><br>Driver: Sure. <br><br>Here it is. <br><br>It was valid. <br><br>Captain: Who&apos;s car is this? <br><br>Driver: It&apos;s mine, officer. <br><br>Here&apos;s the owner&apos; card. <br><br>The driver owned the car. <br><br>Captain: Could you slowly open your glove box so I can see if there&apos;s a gun in it? <br><br>Driver: Yes, sir, but there&apos;s no gun in it. <br><br>Sure enough, there was nothing in the glove box. <br><br>Captain: Would you mind opening your trunk? <br><br> I was told you said there&apos;s a body in it. <br><br>Driver: No problem. <br><br>Trunk is opened; no body. <br><br>Captain: I don&apos;t understand it. <br><br>The officer who stopped you said you told him you didn&apos;t have a license, stole the car, had a gun in the glovebox, and that there was a dead body in the trunk. <br><br>Driver: Yeah, I&apos;ll bet the liar told you I was speeding, too",
