        "_id": "rNjRYr7vs8udxbGDQ",
        "title": "Little johnny was 7 years old, and like other boys his age...",
        "body": "Little Johnny was 7 years old, and like other boys his age, rather curious. <br><br>He had been hearing quite a bit about courting fromother boys and he wondered what it was and how it was done. <br><br>One day he took his questions to his mother, and she becameflustered. <br><br>Instead of explaining things to Johnny she told him tohide behind the curtains one night and watch his older sister and her boyfriend. <br><br>This he did, and the following morning Johnnydescribed everything to his mother. <br><br>Sis and her boyfriend sat and talked for awhile, then he turned offmost of the lights. <br><br>Then he started to kiss and hug her, I figuredsis must be getting sick because her face started looking funny. <br><br>He must have thought so too because he put his hand inside her blouse tofeel her heart, just like the doctor would. <br><br>Except he&apos;s not as goodas the doctor, because he seemed to have trouble finding her heart. <br><br>He was getting sick too, because pretty soon both of them startedpanting and getting all out of breath. <br><br>His other hand must have beengetting cold because he put it under her skirt. <br><br>About this time, sisgot toward the end of the couch. <br><br>This was when the fever started. <br><br>Iknow it was a fever because sis told him she was really hot. <br><br>Finally, I found out what was making them so sick... a big eel hadgotten inside his pants somehow. <br><br>It just jumped out of his pants and stood there about 9 inches long. <br><br>Honest! <br><br> anyway, he grabbed itin one hand to keep it from getting away. <br><br>When sis saw it she gotreally scared. <br><br>Her eyes big and her mouth fell open, and she startedcalling out to God and stuff like that. <br><br>I should tell her about theones I saw at the lake! <br><br>Anyway, sis got brave and tried to kill the eel by bitting its head off. <br><br>All of a sudden, she made a noise and let the eel go. <br><br>I guess it bit herback. <br><br>Then she grabbed it with both hands and held it tight while he tooka muzzle out of his pocket and slipped it over the eels head to keep itfrom biting again. <br><br>Sis lay back and spread her legs so she could get ascissor lock on it, and he helped by laying on the top of the eel. <br><br>The eelput up a hell of a fight. <br><br>Sis started groaning and squeeling and herboyfriend almost upset the couch. <br><br>I guess they wanted to kill the eel bysquishing it between them. <br><br>After a while they both quit moving and gave a great sigh. <br><br>Her boyfriendsat up and sure enough they had killed the eel. <br><br>I knew it was dead becauseit just hung there limp and some of its insides were hanging out. <br><br>Sis andher boyfriend were a little tired from the battle, but they went on courtinganyway. <br><br>He started hugging and kissing her again, and by golly, the eel wasn&apos;t dead after all. <br><br>It jumped straight up and started to fight again. <br><br>I guess eelsare like cats... They have nine lives or something. <br><br>This time sis jumped up and tried to kill the eel by sitting on it. <br><br>After about 35 minutes of struggle, they finally killed the eel. <br><br>I know it was dead this timebecause I saw sis&apos;s boyfriend peel off the skin and flush it down the toilet. <br><br>Mother fainted. <br><br>",
