        "_id": "rQqavoTGqCEuFB5uQ",
        "title": "Obey the speed limit",
        "body": "Sitting on the side of the highway waiting to catch speeding drivers, a State Police Officer see&apos;s a car puttering along at 22 MPH. <br><br>He thinks to himself, &#x201C;This driver is just as dangerous as a speeder!&#x201D; So he turns on his lights and pulls the driver over. <br><br>Approaching the car, he notices that there are five old ladies, two in the front seat and three in the back, wide eyed and white as ghosts. <br><br>The driver, obviously confused, says to him, &#x201C;Officer, I don&apos;t understand, I was doing exactly the speed limit! <br><br> What seems to be the problem?&#x201D;<br><br>&#x201C;Ma&apos;am, &#x201D; the officer replies, &#x201C;You weren&apos;t speeding, but you should know that driving slower than the speed limit can also be a danger to other drivers.&#x201D;<br><br>&#x201C;Slower than the speed limit?  No sir, I was doing the speed limit exactly twenty-two miles an hour!&#x201D; the old woman says a bit proudly. The State Police officer, trying to contain a chuckle explains to her that &#x201C;22&#x201D; was the route number, not the speed limit. A bit embarrassed, the woman grinned and thanked the officer for pointing out her error. &#x201D; But before I let you go, Ma&apos;am, I have to ask... Is everyone in this car OK?  These women seem awfully shaken and they haven&apos;t muttered a single peep this whole time, &#x201D; the officer asks. &#x201D; Oh, they&apos;ll be all right in a minute officer. We just got off Route 142. &#x201D;",
