        "title": "I'd love to but... (pt iii)",
        "body": "More goofy excuses you can use to get out of going somewhere you just don&apos;t wanna go to. <br><br>I&apos;D LOVE TO BUT...... I have to go to court for kitty littering. &#x201D;... I have to jog my memory. &#x201D;... I have to knit some dust bunnies for a charity bazaar. &#x201D;... I have to rotate my crops. &#x201D;... I have to sit up with a sick ant. &#x201D;... I have to stay home and see if I snore. &#x201D;... I have to study for a blood test. &#x201D;... I have to thaw some karate chops for dinner. &#x201D;... I prefer to remain an enigma. &#x201D;... I think you want the OTHER (fill in your name here). &#x201D;... I&apos;m going to be old someday. &#x201D;... I&apos;m going to count the bristles in my toothbrush. &#x201D;... I&apos;m going to the Missing Persons Bureau to see if anyone is looking for me. &#x201D;... I&apos;m having my baby shoes bronzed. &#x201D;... I&apos;m trying to cut down. &#x201D;... I&apos;m up to my eardrums in waxy buildup. &#x201D;... I&apos;ve been traded to Cincinnati. &#x201D;... My Dress For Obscurity class meets then. &#x201D;... my favorite commercial is on TV. &#x201D;... My uncle escaped... again. &#x201D;... Oooo, having fun gives me prickly heat. &#x201D;",
