        "body": "One day Ms. <br><br>Nelson, a kindergarden teacher, was giving a lesson on imagination. <br><br>What she would do was hold an item behind her back, give a few descriptions of the item, and ask the kids to guess what it was. <br><br>First she said to the children &#x201C;I have something long and yellow behind my back.&#x201D; The kids suggested a pencil. Ms. Nelson said &#x201C;no, i&apos;m holding a bannana, but I like you all&apos;s imagination. Next she said&#x201D; I have something round and red&#x201D; . <br><br>Little Johnny stood up and guessed it was a ball. <br><br>Ms. <br><br>Nelson told Johnny it was an apple but she liked Johnny&apos;s imagination. <br><br>Johnny had an idea. <br><br>He told his teacher, &#x201C;I have something in my pocket that&apos;s warm and it has a head on it. <br><br>Well Ms. <br><br>Nelson got really upset and told Johnny he was to go to the principal&apos;s office for being soo dirty minded. <br><br>Little Johnny then said, &#x201C;No, Ms. <br><br>Nelson, it&apos;s a quarter, but I LIKE YOU&apos;RE IMAGINATION!!! <br><br>",
