        "_id": "szC89gddHgHB4QFTG",
        "title": "Don't erase this",
        "body": "One day when the teacher walked to the black board, she noticed someone had written the word &apos;penis&apos; in tiny letters. <br><br>She turned around, scanned the class looking for the guilty face. <br><br>Finding none, she quickly erased it, and began her class. <br><br>The next day she went into the room, and she saw, in larger letters, the word &apos;penis&apos; again on the black board. <br><br>Again, she looked around in vain for the culprit, but found none, erased it and then proceeded with the day&apos;s lesson. <br><br>Every morning, for about a week, she went into the classroom and found the same disgusting word written on the board, each day&apos;s word, larger than the previous day&apos;s word. <br><br>Finally, one day, she walked in, expecting to be greeted by the same word on the board, but instead, found the words: &#x201C;The more you rub it, the bigger it gets!&#x201D;",
