        "_id": "tXcoqoXsDwRgHvPnJ",
        "title": "Trust a fellow officer",
        "body": "A defense attorney was cross-examining a police officer during a felony trial  it went like this: <br>\r\nQ: Officer, did you see my client fleeing the scene? <br><br><br>\r\nA: No sir, but I subsequently observed a person matching the description of the offender running several blocks away. <br><br><br>\r\nQ: Officer, who provided this description? <br><br><br>\r\nA: The officer who responded to the scene. <br><br><br>\r\nQ: A fellow officer provided the description of this so-called offender. <br><br>Do you trust your fellow officers? <br><br><br>\r\nA: Yes sir, with my life. <br><br><br>\r\nQ: With your life? <br><br> Let me ask you this then officer, do you have a locker room in the police station, a room where you change your clothes in preparation for your daily duties? <br><br><br>\r\nA: Yes sir, we do. <br><br><br>\r\nQ: And do you have a locker in that room? <br><br><br>\r\nA: Yes sir, I do. <br><br><br>\r\nQ: And do you have a lock on your locker? <br><br><br>\r\nA: Yes sir. <br><br><br>\r\nQ: Now why is it, officer, if you trust your fellow officers with your life, that you find it necessary to lock your locker in a room you share with those officers? <br><br><br>\r\nA: You see sir, we share the building with a court complex, and sometimes defense attorneys have been known to walk through that room. <br><br>",
