        "body": "During a recent publicity outing, Hillary sneaked off to visit afortune teller of some local repute. <br><br>In a dark and hazy room, peering into a crystal ball, the my stic delivered grave news. &#x201D; There&apos;s no easy way to say this, so I&apos;ll just be blunt: Prepareyourself to be a widow. <br><br>Your husband will die a violent andhorrible death this year. &#x201D;Visibly shaken, Hillary stared at the woman&apos;s lined face, then at the single flickering candle, then down at her hands. <br><br>She took afew deep breaths to compose herself. <br><br>She simply had to know. <br><br>Shemet the fortune teller&apos;s gaze, steadied her voice, and asked herquestion: &#x201C;Will I be acquitted?&#x201D;",
