        "_id": "vKQEqrRD6hfC4dWz5",
        "title": "First experience horse riding",
        "body": "A blonde decides to learn and try horse back riding unassisted without prior experience or lessons. <br><br>She mounts the horse with great effort, and the tall, shiny horse springs into motion. <br><br>It gallops along at a steady and rhythmic pace, but the blonde begins to slip from the saddle. <br><br>Out of shear terror, she grabs for the horse&apos;s mane but cannot seem to get a firm grip. <br><br>She tries to throw her arms around the horse&apos;s neck, but she slides down the side of the horse anyway. <br><br>The horse gallops along, seemingly oblivious to its slipping rider. <br><br>Finally, giving up her frail grip, she leaps away from the horse to try and throw herself to safety. <br><br>Unfortunately, her foot has become entangled in the stirrup. <br><br>She is now at the mercy of the horse&apos;s pounding hooves as her head is struck against the ground again and again. <br><br>As her head is battered against the ground, she is mere moments away from unconsciousness or even death when Frank, the Wal-Mart manager runs out to shut the horse off. <br><br>",
