        "_id": "vaGiKyP9mPkNkuWT2",
        "title": "Valentine's day gift",
        "body": "A young man wanted to purchase a gift for his new sweetie for Valentine&apos;s Day. <br><br>As they had not been dating very long, it was a very difficult decision. <br><br>After careful consideration he decided a good gift would be a pair of gloves. <br><br>Accompanied by his sister, he went to the store and bought the gloves. <br><br>His sister purchased a pair of panties at the same time. <br><br>The clerk carefully wrapped both items but in the process got them mixed up. <br><br>The sister was handed the gloves and the young man got the panties. <br><br>The young man mailed his Valentine&apos;s Day gift with the following note: &#x201C;This special Valentines Day gift was chosen because I noticed you are in the habit of not wearing any when we go out in the evenings. If it had not been for my sister, I would have chosen the ones with buttons, but she prefers short ones that are much easier to remove. &#x201D; These are a lovely shade, the lady I bought them from showed me the pair she had been wearing for the past three weeks and they were hardly soiled. <br><br>I had her try yours on for me and they looked quite lovely. <br><br>I wish I was there to put them on you for the first time; no doubt, other hands will come into contact with them before I have a chance to see you again. <br><br>When you take them off, remember to blow on them lightly before putting them away as they will naturally be a little damp from wearing. <br><br>Just think how many times I&apos;ll be kissing them in the future. <br><br>I hope you&apos;ll wear them Friday night for me. <br><br>Love, Honey Bearp. <br><br>s. <br><br>The sales lady says the latest style is to wear them folded down with just a little fur showing. <br><br>",
