        "title": "A bus conversation",
        "body": "A bus stops and two Italian men get on. <br><br>They seat themselves andengage in animated conversation. <br><br>The lady sitting behind themignores their conversation at first, but her attention isgalvanized when she hears one of the men saying the following;&#x201D; Emma come first. <br><br>Denna I come. <br><br>Two asses, they come together. <br><br>I come again. <br><br>Two asses, they come together again. <br><br>I come again and pee twice. <br><br>Denna I come once-a more.&#x201D; <br><br>&#x201C;You fowl-mouthed swine, &#x201D; retorted the lady indignantly. &#x201C;In this country we don&apos;t talk about our sex lives in public!&#x201D; Hey, coola down lady,&#x201D; said the man, &#x201C;Imma justa tellun my friend howa to spella Mississippi. &#x201D;",
