        "_id": "wR3tP4h4tT5Qmhp7K",
        "title": "Who says men don't remember anniversaries",
        "body": "A woman awakes during the night to find that her husband was not in their bed. <br><br>She puts on her robe and goes downstairs to look for him. <br><br>She finds him sitting at the kitchen table with a cup of coffee in front him. <br><br>He appears deep in thought, just staring at the wall. <br><br>She watches as he wipes a tear from his eye and takes a sip of coffee. <br><br>&#x201C;What&apos;s the matter, dear?&#x201D; she whispers as she steps into the room. <br><br>&#x201C;Why are you down here at this time of night?&#x201D; The husband looks up, &#x201C;Do you remember 20 years ago when we were dating, and you were only 17?&#x201D; he asks solemnly. <br><br>The wife is touched thinking her husband is so caring and sensitive. &#x201D; Yes, I do, &#x201D; she replies. The husband pauses. The words are not coming easily. &#x201C;Do you remember when you father caught us in the back seat of my car?&#x201D;<br><br>&#x201C;Yes, I remember,&#x201D; says the wife, lowering herself into a chair beside him. The husband continues... &#x201C;Do you remember when he shoved a shotgun in my face and said, &#x201C;Either you marry my daughter, or I will send you to jail for 20 years&#x201D; . &#x201C;I remember that too&#x201D; , she replies softly. He wipes another tear from his cheek and says... &#x201C;I would have gotten out today!&#x201D;",
