        "title": "Lawyer: send me",
        "body": "NASA was interviewing professionals to be sent to Mars. <br><br>Only one could go, but with one catch<br><br> - he couldn&apos;t return to Earth. <br><br>The first applicant, an engineer, was asked how much he wanted to be paid for going. &#x201D; One million dollars, &#x201D; he answered, &#x201C;because I want to donate it to M. I. <br><br>T.&#x201D; The next applicant, a doctor, was asked the same question. He asked for two million. &#x201C;I want to give a million to my family, &#x201D; he explained, &#x201C;and leave the other million for the advancement of medical research.&#x201D; The last applicant was a lawyer. When asked how much money he wanted, he whispered in the interviewer&apos;s ear, &#x201C;Three million dollars.&#x201D;<br><br>&#x201C;Why so much more than the others?&#x201D; the interviewer asked. The lawyer replied, &#x201C;If you give me $3 million, I&apos;ll give you $1 million, I&apos;ll keep $1 million, and we&apos;ll send the engineer. &#x201D;",
