        "_id": "wiLfWx4w9LyJN5hGP",
        "title": "Insult collection #8",
        "body": "For two cents, I`d give you a piece of my mind  and all of yours. <br><br>You are the only person I&apos;ve ever met whose mind is filthy and sterile at the same time! <br><br> You have no trouble making ends meet. <br><br>Your foot is always in your mouth! <br><br> I heard you went to see the doctor and told him that you wanted a little wart removed so he had you thrown out of his office. <br><br>I think Mother Nature really hates you because you remind her so much of all her mistakes! <br><br> You must be the arithmetic man  you add trouble, subtract pleasure, divide attention, and multiply ignorance. <br><br>Some people are has-beens. <br><br>You are a never-was. <br><br>You started at the bottom  and it&apos;s been downhill ever since. <br><br>You are so boring that you can&apos;t even entertain a doubt. <br><br>I don&apos;t mind that you are talking so long as you don&apos;t mind that I&apos;m not listening. <br><br>I heard that you were born, your father threw rocks at the stork. <br><br>I used to think that you were a big pain in the neck. <br><br>Now I have a much lower opinion of you. <br><br>",
