        "_id": "x2zMJhZ6cGrxtjzL9",
        "title": "Wedding toasts 1",
        "body": "Marriage has driven more than one man to sex. <br><br>Marriage is a ceremony that turns your dreamboat into a barge. <br><br>Marriage is a mutual relationship if both parties know when to be mute. <br><br>Marriage is a rest period between romances. <br><br>Marriage is a three ring circus: engagement ring, wedding ring, and suffering. <br><br>Marriage is a trip between Niagra Falls and Reno. <br><br>Marriage is an institution, but who wants to live in an institution? <br><br>Marriage is better when both the husband and wife decide that what they have is better than what they are missing. <br><br>Marriage is bliss. <br><br>Ignorance is bliss. <br><br>Ergo... Marriage is like a hot bath. <br><br>Once you get used to it, it&apos;s not so hot. <br><br>Marriage is like a mousetrap. <br><br>Those on the outside are trying to get in. <br><br>Those on the inside are trying to get out. <br><br>Marriage is like a violin. <br><br>After the music is over, you still have the strings. <br><br>Marriage is mind over matter; if the husband doesn&apos;t mind, it doesn&apos;t matter.. Marriage is not a word; it is a sentence. <br><br>Marriage is the high sea for which no compass has yet been invented. <br><br>Marriage is the mourning after the knot before. <br><br>Marriage is the only sport in which the trapped animal has to buy the license. <br><br>Marriage is the only war in which you sleep with the enemy. <br><br>Marriage is the process of finding out what kind of person your spouse would have really preferred. <br><br>Marriage is the triumph of imagination over intelligence. <br><br>Second marriage is the triumph of hope over experience. <br><br>Marriage is when a man and woman become as one; the trouble starts when they try to decide which one. <br><br>Marriage means commitment. <br><br>Of course, so does insanity. <br><br>Marriage still confers one very special privilege, only a married person can get divorced. <br><br>Marriages are made in heaven. <br><br>But so again, so are thunder and lightning. <br><br>A best man&apos;s speech should be like a mini-skirt; short enough to be interesting, but long enough to cover the bare essentials. <br><br>A chiseler is a man who goes stag to a wife-swapping party. <br><br>A gentleman is one who never swears at his wife while ladies are present. <br><br>A good husband is one who thinks almost as much of his wife as he does of himself. <br><br>A good woman is like a good bar... liquor in the front and poker in the rear. <br><br>A honeymoon should be like a table... four bare legs and no drawers. <br><br>A husband expects his wife to be perfect... and to understand why he&apos;s not. <br><br>",
        "tags": [
            "Jokes",
            "Miscellaneous Jokes"
        ],
        "url": "http://www.10000funnyjokes.com/jokes-miscellaneous-41-wedding-toasts-1-9133",
