        "title": "Wanted for attempted murder",
        "body": "WANTED FOR ATTEMPTED MURDER (actual AP headline) Linda Burnett, 23, a resident of San Diego, was visiting her inlaws, and while there, she went to a nearby supermarket to pick up some groceries. <br><br>Several people noticed her sitting in her car with the windows rolled up and with her eyes closed, with both hands behind the back of her head. <br><br>One customer who had been at the store for a while became concerned and walked over to the car. <br><br>He noticed that Linda&apos;s eyes were now open, and she looked very strange. <br><br>He asked her if she was okay, and Linda replied that she&apos;d been shot in the back of the head, and had been holding her brains in for over an hour. <br><br>The man called the paramedics, who broke into the car because the doors were locked and Linda refused to remove her hands from her head. <br><br>When they finally got in, they found that Linda had a wad of bread dough on the back of her head. <br><br>A Pillsbury biscuit canister had exploded from the heat, making a loud noise that sounded like a gunshot, and the wad of dough hit her in the back of her head. <br><br>When she reached back to find out what it was, she felt the dough and thought it was her brains. <br><br>She initially passed out, but quickly recovered and tried to hold her brains in for over an hour until someone noticed and came to her aid. <br><br>And, yes, Linda is a blonde. <br><br>",
