        "body": "Two young engineers applied for a single position at a computer company. <br><br>They both had the same qualifications. <br><br>In order to determine which individual to hire, the applicants were asked to take a test by the Department manager. <br><br>Upon completion of the test, both men missed only one of the questions. <br><br>The manager went to the first applicant and said, &#x201C;Thank you for your interest, but we&apos;ve decided to give the job to the other applicant.&#x201D;<br><br>&#x201C;And why would you be doing that?  We both got 9 questions correct, &#x201D; asked the rejected applicant. &#x201C;We have based our decision not on the correct answers, but on the question you missed,&#x201D; said the Department manager. &#x201D; And just how would one incorrect answer be better than the other?&#x201D; the rejected applicant inquired. &#x201D; Simple,&#x201D; said the Department manager... &#x201C;Your fellow applicant put down on question #5, &apos;I don&apos;t know. &apos; You put down, &apos;Neither do I. &apos;&#x201D;",
