        "body": "Back when Bill Clinton and Hillary got married Bill told her, &#x201C;There&apos;s one thing I want you to know. There&apos;s a box under my bed, and I don&apos;t want you to look in it until I die. &#x201D; Hillary agreed to this but, over the years, the curiosity got the better of her, and she finally looked in it. She found three beer cans and 1.5 million dollars in cash. When she asked Bill what the beer cans were for, he replied, &#x201C;Well, those are for all the times I&apos;ve cheated on you. &#x201D; Hillary said, &#x201C;Well, that&apos;s not bad after all these years, and you being a politician, and traveling and all. &#x201D; She was about to leave, but then she said, &#x201C;Hey, Bill, what about the 1.5 million dollars?&#x201D; Bill replied, &#x201C;That&apos;s for all the times the box got full and I had to cash the cans in. &#x201D;",
